
function AbaAbrirFormularioUndock(parent, sys, formID) {
  this.ruleName = 'Aba - Abrir Formulário (Undock)';
  this.functionName = 'AbaAbrirFormularioUndock';
  this.parent = parent;
  this.sys = sys;
  this.formID = formID;
  this.translations = new Map();
}

AbaAbrirFormularioUndock.prototype = new Rule;

/**
 * Esta função executa a regra "Aba - Abrir Formulário (Undock)"
 * @param MolduraFechar equivale à variável this.context['MolduraFechar']<br/>
 * @param Lista de formulários equivale à variável this.context['Lista de formulários']<br/>
 * @param Títulos equivale à variável this.context['Títulos']<br/>
 * @param MolduraGeral equivale à variável this.context['MolduraGeral']<br/>
 * @param Lista de Filtros equivale à variável this.context['Lista de Filtros']<br/>
 * @author Danilo
 * @since 27/01/2021 09:40:17
 */
AbaAbrirFormularioUndock.prototype.run = function() {
  document.ruleNameForException = 'Aba - Abrir Formulário (Undock)';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['MolduraFechar'] = this.checkType(arguments[0], 'Letras');

  this.context['Lista de formulários'] = this.checkType(arguments[1], 'Letras');

  this.context['Títulos'] = this.checkType(arguments[2], 'Letras');

  this.context['MolduraGeral'] = this.checkType(arguments[3], 'Letras');

  this.context['Lista de Filtros'] = this.checkType(arguments[4], 'Variante');

  // Variáveis
  this.context['Contador'] = 0;

  this.context['Contador'] = parseInt(1);

  /**
   * O prefixo "aba" está presente no nome?
   */
  if (parseBoolean(isEqual.call(this, ebfSubstring.call(this, this.context['MolduraFechar'], parseInt(1), parseInt(3)), 'aba'))) {
      
    /**
     * Remover prefixo "aba"
     */
    this.context['MolduraFechar'] = ebfSubstring.call(this, this.context['MolduraFechar'], parseInt(4), ebfLength.call(this, this.context['MolduraFechar']));

    return this.FlowExpression5();

  } else {

    return this.FlowExpression5();

  }

}

AbaAbrirFormularioUndock.prototype.FlowExpression5 = function() {

    /**
     * Remover nome da moldura
     */
    this.context['MolduraFechar'] = ebfReplace.call(this, this.context['MolduraFechar'], this.context['MolduraGeral'], '');

    /**
     * Existe mais de uma aba aberta?
     */
    if (parseBoolean(ebfSearchSubstring.call(this, this.context['Títulos'], ','))) {
        
      /**
       * Existe subsequência?
       */
      while (parseBoolean(oprNot.call(this, (ebfSearchSubstring.call(this, ebfGetElementFromList.call(this, ebfSplit.call(this, this.context['Títulos'], ','), this.context['Contador']), this.context['MolduraFechar']) && isEqual.call(this, ebfLength.call(this, ebfGetElementFromList.call(this, ebfSplit.call(this, this.context['Títulos'], ','), this.context['Contador'])), ebfLength.call(this, this.context['MolduraFechar'])))))) {

        /**
         * Cont++
         */
        this.context['Contador'] = oprAdd.call(this, this.context['Contador'], parseInt(1));
      }

      return this.FlowDecision7();

    } else {

      /**
       * A aba ativa é a aba a ser aberta?
       */
      if (parseBoolean((ebfSearchSubstring.call(this, this.context['Títulos'], this.context['MolduraFechar']) && isEqual.call(this, ebfLength.call(this, this.context['Títulos']), ebfLength.call(this, this.context['MolduraFechar']))))) {
          
        /**
         * A lista possui vírgula?
         */
        if (parseBoolean(ebfSearchSubstring.call(this, this.context['Lista de formulários'], ','))) {
            
          return this.FlowDecision7();

        } else {

          /**
           * Formulário possui filtro?
           */
          if (parseBoolean((oprNot.call(this, isNullOrEmpty.call(this, this.context['Lista de Filtros'])) && oprNot.call(this, isNullOrEmpty.call(this, ebfMapGetObject.call(this, this.context['Lista de Filtros'], ebfTrim.call(this, ebfGetElementFromList.call(this, ebfSplit.call(this, this.context['Lista de formulários'], ','), this.context['Contador'])))))))) {
              
            /**
             * Aba - Abrir Formulário Filtrado
             */
            executeSyncJavaRule.call(this, this.getSystem(), this.getForm(), 'Aba - Abrir Formulário Filtrado', [ebfTrim.call(this, this.context['Lista de formulários']), ebfMapGetObject.call(this, this.context['Lista de Filtros'], ebfTrim.call(this, ebfGetElementFromList.call(this, ebfSplit.call(this, this.context['Lista de formulários'], ','), this.context['Contador'])))]);

            return this.FlowEnd2();

          } else {

            /**
             * Abrir formulário undock
             */
            ebfFormOpenForm.call(this, ebfTrim.call(this, this.context['Lista de formulários']));

            return this.FlowEnd2();

          }

        }

      } else {

        /**
         * Fim
         */
        return null;

      }

    }
  }

AbaAbrirFormularioUndock.prototype.FlowConnector5 = function() {

    return this.FlowEnd2();
  }

AbaAbrirFormularioUndock.prototype.FlowEnd2 = function() {

    /**
     * Fim
     */
    return null;
  }

AbaAbrirFormularioUndock.prototype.FlowDecision7 = function() {

    /**
     * Formulário possui filtro?
     */
    if (parseBoolean((oprNot.call(this, isNullOrEmpty.call(this, this.context['Lista de Filtros'])) && oprNot.call(this, isNullOrEmpty.call(this, ebfMapGetObject.call(this, this.context['Lista de Filtros'], ebfTrim.call(this, ebfGetElementFromList.call(this, ebfSplit.call(this, this.context['Lista de formulários'], ','), this.context['Contador'])))))))) {
        
      /**
       * Aba - Abrir Formulário Filtrado
       */
      executeSyncJavaRule.call(this, this.getSystem(), this.getForm(), 'Aba - Abrir Formulário Filtrado', [ebfTrim.call(this, ebfGetElementFromList.call(this, ebfSplit.call(this, this.context['Lista de formulários'], ','), this.context['Contador'])), ebfMapGetObject.call(this, this.context['Lista de Filtros'], ebfTrim.call(this, ebfGetElementFromList.call(this, ebfSplit.call(this, this.context['Lista de formulários'], ','), this.context['Contador'])))]);

      return this.FlowConnector5();

    } else {

      /**
       * Abrir formulário undock
       */
      ebfFormOpenForm.call(this, ebfTrim.call(this, ebfGetElementFromList.call(this, ebfSplit.call(this, this.context['Lista de formulários'], ','), this.context['Contador'])));

      return this.FlowConnector5();

    }
  }


function runAbaAbrirFormularioUndock(parent, sys, formID, params) {
  var rule = new AbaAbrirFormularioUndock(parent, sys, formID);
  rule.run.apply(rule, params);
}

function AbaAbrirFormularioNaMoldura(parent, sys, formID) {
  this.ruleName = 'Aba - Abrir Formulário na Moldura';
  this.functionName = 'AbaAbrirFormularioNaMoldura';
  this.parent = parent;
  this.sys = sys;
  this.formID = formID;

  this.translations = new Map();

}

AbaAbrirFormularioNaMoldura.prototype = new Rule;

/**
 * Esta função executa a regra "Aba - Abrir Formulário na Moldura"
 * @param Formulário que será aberto equivale à variável this.context['Formulário que será aberto']<br/>
 * @param Titulo equivale à variável this.context['Titulo']<br/>
 * @param Mapa de propriedades equivale à variável this.context['Mapa de propriedades']<br/>
 * @param Evento equivale à variável this.context['Evento']<br/>
 * @param Filtro equivale à variável this.context['Filtro']<br/>
 * @author master
 * @since 23/02/2022 10:14:46
 */
AbaAbrirFormularioNaMoldura.prototype.run = function() {
  document.ruleNameForException = 'Aba - Abrir Formulário na Moldura';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Formulário que será aberto'] = this.checkType(arguments[0], 'Letras');

  this.context['Titulo'] = this.checkType(arguments[1], 'Letras');

  this.context['Mapa de propriedades'] = this.checkType(arguments[2], 'Variante');

  this.context['Evento'] = this.checkType(arguments[3], 'Letras');

  this.context['Filtro'] = this.checkType(arguments[4], 'Letras');

  // Variáveis
  this.context['Formulário Principal'] = '';

  this.context['Lista de Formulários'] = '';

  this.context['Lista de Títulos'] = '';

  this.context['Aba Formulário'] = '';

  this.context['Lista de Abas Ativas'] = '';

  this.context['Aba Ativa'] = '';

  this.context['Aba Selecionada'] = '';

  this.context['Evento ao clicar'] = '';

  this.context['Lista de parâmetros do fluxo'] = null;

  this.context['Lista do Evento'] = null;

  this.context['Lista de valores dos parâmetros do fluxo'] = null;

  this.context['ID Abas Content'] = '';

  this.context['Existe Título'] = false;

  this.context['Iframe Aba Selecionada'] = null;

  this.context['Lista de Filtros'] = null;


  /**
   * Obter nome do formulário !
   */
  this.context['Formulário Principal'] = ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'formulario');

  /**
   * Obter Lista de Formulários !
   */
  this.context['Lista de Formulários'] = ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'listaformularios');

  /**
   * Obter Lista de Títulos !
   */
  this.context['Lista de Títulos'] = ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'titulos');

  /**
   * Obter Lista de Filtros !
   */
  this.context['Lista de Filtros'] = ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'filtros');

  /**
   * Traduzir Titulos !
   */
  this.context['Lista de Títulos'] = ebfTranslate.call(this, this.context['Lista de Títulos'], null);

  /**
   * Traduzir Titulo
   */
  this.context['Titulo'] = ebfTranslate.call(this, this.context['Titulo'], null);

  /**
   * Obter moldura de contéudos das abas !
   */
  this.context['ID Abas Content'] = ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'molduraContainer');

  /**
   * Definir Variável de Sessão
   */
  ebfSetClientFormVariable.call(this, 'MolduraGeral', this.context['ID Abas Content']);

  /**
   * Obter Aba do Formulário !
   */
  this.context['Aba Formulário'] = ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'abacontendomoldura');

  /**
   * Obter Lista de Abas Ativas !
   */
  this.context['Lista de Abas Ativas'] = ebfGetClientFormVariable.call(this, ebfConcat.call(this, this.context['ID Abas Content'], 'abascriadas'));

  /**
   * Obter a aba que foi selecionada !
   */
  this.context['Aba Selecionada'] = ebfConcat.call(this, 'aba', this.context['Titulo'], this.context['ID Abas Content']);

  /**
   * Obter aba ativa !
   */
  this.context['Aba Ativa'] = ebfGetClientFormVariable.call(this, ebfConcat.call(this, 'AbaAtiva', this.context['ID Abas Content']));

  /**
   * Definir Variável de Sessão
   */
  ebfSetClientFormVariable.call(this, ebfConcat.call(this, 'AbaAtiva', this.context['ID Abas Content']), this.context['Aba Ativa']);

  /**
   * Aba - Verificar se o título já existe
   */
  this.context['Existe Título'] = new AbaVerificarSeOTituloJaExiste(this, this.getSystem(), this.getForm()).run(this.context['Lista de Abas Ativas'], this.context['Aba Selecionada']);

  /**
   * É nulo ou vazio, existe subsequência
   */
  if (parseBoolean(((isNullOrEmpty.call(this, this.context['Lista de Abas Ativas']) || oprNot.call(this, this.context['Existe Título'])) || isNullOrEmpty.call(this, ebfHtmlGetMakerElementById.call(this, this.context['Aba Selecionada']))))) {
      
    /**
     * Ocultar overflow !
     */
    ebfGroupBoxAddScroll.call(this, this.context['Aba Formulário'], 'hidden', 'hidden');

    /**
     * Criar moldura do conteúdo da aba !
     */
    ebfGroupBoxNew.call(this, this.context['Aba Formulário'], parseInt(0), parseInt(0), '100%', '100%', this.context['Aba Selecionada'], this.context['Aba Selecionada'], parseInt(6));

    /**
     * Atribuir novo ID
     */
    ebfHtmlSetAttribute.call(this, ebfHtmlGetMakerElementById.call(this, this.context['Aba Selecionada']), 'id', ebfConcat.call(this, this.context['Titulo'], ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'Nome')));

    /**
     * Adicionar atributo webrun-tab-component
     */
    ebfHtmlSetAttribute.call(this, ebfHtmlGetMakerElementById.call(this, this.context['Aba Selecionada']), 'webrun-tab-component', ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'Nome'));

    /**
     * Definir classe
     */
    ebfHtmlSetAttribute.call(this, ebfHtmlGetMakerElementById.call(this, this.context['Aba Selecionada']), 'class', 'w-100 h-auto overflow-hidden d-flex flex-fill');

    /**
     * Associando moldura da aba com a com a moldura container !
     */
    ebfAssociatingComponent.call(this, this.context['Aba Selecionada'], this.context['ID Abas Content']);

    /**
     * É nulo ou vazio, existe subsequência
     */
    if (parseBoolean((isNullOrEmpty.call(this, this.context['Lista de Abas Ativas']) || oprNot.call(this, this.context['Existe Título'])))) {
        
      /**
       * Adicionar aba seleciona a lista de abas ativas !
       */
      ebfSetClientFormVariable.call(this, ebfConcat.call(this, this.context['ID Abas Content'], 'abascriadas'), ebfConcat.call(this, this.context['Lista de Abas Ativas'], this.context['Aba Selecionada'], ';'));

      return this.FlowExpression7();

    } else {

      return this.FlowExpression7();

    }

  } else {

    /**
     * Ocultar aba ativa !
     */
    ebfFormSetVisible.call(this, this.context['Aba Ativa'], false);

    /**
     * Mostrar aba selecionada !
     */
    ebfFormSetVisible.call(this, this.context['Aba Selecionada'], true);

    /**
     * Ocultar overflow
     */
    ebfGroupBoxAddScroll.call(this, this.context['Aba Selecionada'], 'hidden', 'hidden');

    return this.FlowConnector1();

  }

}

AbaAbrirFormularioNaMoldura.prototype.FlowExpression11 = function() {

    /**
     * Obter iframe da aba selecionada !
     */
    this.context['Iframe Aba Selecionada'] = ebfHtmlGetElementsByTagName.call(this, 'iframe', ebfHtmlGetMakerElementById.call(this, this.context['Aba Selecionada']));

    /**
     * Iframe já existe na aba selecionada ?
     */
    if (parseBoolean(isGreaterOrEqual.call(this, ebfListLength.call(this, this.context['Iframe Aba Selecionada']), parseInt(1)))) {
        
      /**
       * Filtro é nulo ou vazio?
       */
      if (parseBoolean(isNullOrEmpty.call(this, this.context['Filtro']))) {
          
        return this.FlowExpression26();

      } else {

        /**
         * Abrir formulário filtrado na moldura
         */
        ebfFrameOpenFilteredForm.call(this, this.context['Formulário Principal'], this.context['Aba Selecionada'], this.context['Formulário que será aberto'], true, this.context['Filtro'], false);

        return this.FlowConnector3();

      }

    } else {

      /**
       * Filtro é nulo ou vazio?
       */
      if (parseBoolean(isNullOrEmpty.call(this, this.context['Filtro']))) {
          
        /**
         * Abrir formulário na moldura
         */
        ebfFrameOpenForm.call(this, this.context['Formulário Principal'], this.context['Aba Selecionada'], this.context['Formulário que será aberto'], true, false);

        return this.FlowExpression15();

      } else {

        /**
         * Abrir formulário filtrado na moldura
         */
        ebfFrameOpenFilteredForm.call(this, this.context['Formulário Principal'], this.context['Aba Selecionada'], this.context['Formulário que será aberto'], true, this.context['Filtro'], false);

        return this.FlowExpression15();

      }

    }
  }

AbaAbrirFormularioNaMoldura.prototype.FlowExpression7 = function() {

    /**
     * Obter aba ativa
     */
    this.context['Aba Ativa'] = ebfGetClientFormVariable.call(this, ebfConcat.call(this, 'AbaAtiva', this.context['ID Abas Content']));

    /**
     * Existe aba ativa?
     */
    if (parseBoolean(isNullOrEmpty.call(this, this.context['Aba Ativa']))) {
        
      return this.FlowExpression11();

    } else {

      /**
       * Ocultar aba ativa !
       */
      ebfFormSetVisible.call(this, this.context['Aba Ativa'], false);

      return this.FlowConnector1();

    }
  }

AbaAbrirFormularioNaMoldura.prototype.FlowExpression26 = function() {

    /**
     * Atribuir títulos
     */
    ebfMapAddObject.call(this, this.context['Mapa de propriedades'], 'titulos', this.context['Lista de Títulos']);

    /**
     * Atribuir títulos selecionado
     */
    ebfMapAddObject.call(this, this.context['Mapa de propriedades'], 'tituloselecionado', this.context['Titulo']);

    /**
     * Criar lista apartir dos formulários existentes
     */
    ebfMapAddObject.call(this, this.context['Mapa de propriedades'], 'listaformularios', this.context['Lista de Formulários']);

    /**
     * Aba - Criando abas
     */
    new AbaCriandoAbas(this, this.getSystem(), this.getForm()).run(this.context['Mapa de propriedades']);

    /**
     * Definir variável de sessão contendo nome da aba ativa
     */
    ebfSetClientFormVariable.call(this, ebfConcat.call(this, 'AbaAtiva', this.context['ID Abas Content']), this.context['Aba Selecionada']);

    /**
     * Evento é nulo?
     */
    if (parseBoolean(isNullOrEmpty.call(this, this.context['Evento']))) {
        
      /**
       * Fim
       */
      return null;

    } else {

      /**
       * Obter lista Eventos/Parâmetros
       */
      this.context['Lista do Evento'] = ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'AoClicar');

      /**
       * Lista de Evento é nula?
       */
      if (parseBoolean(isNullOrEmpty.call(this, this.context['Lista do Evento']))) {
          
        return this.FlowEnd1();

      } else {

        /**
         * Obter nome do fluxo
         */
        this.context['Evento ao clicar'] = ebfGetElementFromList.call(this, this.context['Lista do Evento'], parseInt(2));

        /**
         * Obter lista de parâmetros do fluxo
         */
        this.context['Lista de parâmetros do fluxo'] = ebfGetElementFromList.call(this, this.context['Lista do Evento'], parseInt(3));

        /**
         * Inserir o guid do formulário que será aberto na lista
         */
        this.context['Lista de parâmetros do fluxo'] = ebfReplaceElementFromList.call(this, this.context['Lista de parâmetros do fluxo'], parseInt(1), ebfConcat.call(this, '\"', this.context['Formulário que será aberto'], '\"'));

        /**
         * Inserir o título do formulário que será aberto na lista
         */
        this.context['Lista de parâmetros do fluxo'] = ebfReplaceElementFromList.call(this, this.context['Lista de parâmetros do fluxo'], parseInt(2), ebfConcat.call(this, '\"', this.context['Titulo'], '\"'));

        /**
         * Geral - Parse do Valor
         */
        this.context['Lista de valores dos parâmetros do fluxo'] = new GeralParseDoValor(this, this.getSystem(), this.getForm()).run(this.context['Lista de parâmetros do fluxo']);

        /**
         * Executar fluxo ao clicar na aba
         */
        ebfFlowExecute.call(this, this.context['Evento ao clicar'], this.context['Lista de valores dos parâmetros do fluxo']);

        return this.FlowEnd1();

      }

    }
  }

AbaAbrirFormularioNaMoldura.prototype.FlowExpression15 = function() {

    /**
     * Obter iframe da aba selecionada !
     */
    this.context['Iframe Aba Selecionada'] = ebfGetElementFromList.call(this, ebfHtmlGetElementsByTagName.call(this, 'iframe', ebfHtmlGetMakerElementById.call(this, this.context['Aba Selecionada'])), parseInt(1));

    /**
     * Definir altura do iframe !
     */
    ebfHtmlCssDefineStyle.call(this, this.context['Iframe Aba Selecionada'], 'height', '100%');

    /**
     * Definir Atributo
     */
    ebfHtmlSetAttribute.call(this, this.context['Iframe Aba Selecionada'], 'componenteaba', ebfConcat.call(this, this.context['Titulo'], 'Close', ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'Nome')));

    /**
     * Definir altura do pai do iframe !
     */
    ebfHtmlCssDefineStyle.call(this, ebfHtmlGetParent.call(this, this.context['Iframe Aba Selecionada']), 'height', '100%');

    return this.FlowConnector3();
  }

AbaAbrirFormularioNaMoldura.prototype.FlowConnector1 = function() {

    return this.FlowExpression11();
  }

AbaAbrirFormularioNaMoldura.prototype.FlowConnector3 = function() {

    return this.FlowExpression26();
  }

AbaAbrirFormularioNaMoldura.prototype.FlowEnd1 = function() {

    /**
     * Fim
     */
    return null;
  }


