function AbaAdicionarNovaAba(parent, sys, formID) {
  this.ruleName = 'Aba - Adicionar Nova Aba';
  this.functionName = 'AbaAdicionarNovaAba';
  this.parent = parent;
  this.sys = sys;
  this.formID = formID;

  this.translations = new Map();

}

AbaAdicionarNovaAba.prototype = new Rule;

/**
 * Esta função executa a regra "Aba - Adicionar Nova Aba"
 * @param Componente Aba equivale à variável this.context['Componente Aba']<br/>
 * @param Formulário equivale à variável this.context['Formulário']<br/>
 * @param Título equivale à variável this.context['Título']<br/>
 * @param Filtro equivale à variável this.context['Filtro']<br/>
 * @author Janpier
 * @since 07/03/2022 09:18:50
 */
AbaAdicionarNovaAba.prototype.run = function() {
  document.ruleNameForException = 'Aba - Adicionar Nova Aba';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Componente Aba'] = this.checkType(arguments[0], 'Letras');

  this.context['Formulário'] = this.checkType(arguments[1], 'Letras');

  this.context['Título'] = this.checkType(arguments[2], 'Letras');

  this.context['Filtro'] = this.checkType(arguments[3], 'Letras');

  // Variáveis
  this.context['Mapa'] = null;

  this.context['Lista'] = null;

  this.context['Atributos'] = null;

  this.context['PosicaoX'] = 0;

  this.context['PosicaoY'] = 0;

  this.context['Altura'] = 0;

  this.context['Largura'] = 0;

  this.context['Container'] = null;


  /**
   * Traduz o nome do titulo
   */
  this.context['Título'] = ebfTranslate.call(this, this.context['Título'], null);

  /**
   * Obter valor da variável
   */
  this.context['Lista'] = ebfGetClientFormVariable.call(this, ebfConcat.call(this, this.context['Componente Aba'], 'propriedadeselementos'));

  /**
   * Obter mapa de propriedades !
   */
  this.context['Mapa'] = ebfGetClientFormVariable.call(this, this.context['Componente Aba']);

  /**
   * Exisite componente aba?
   */
  if (parseBoolean(oprNot.call(this, isNullOrEmpty.call(this, ebfHtmlGetElementById.call(this, this.context['Componente Aba']))))) {
      
    /**
     * Obter Atributos do Data
     */
    this.context['Atributos'] = ebfSplit.call(this, ebfHtmlGetAttribute.call(this, ebfHtmlGetElementById.call(this, this.context['Componente Aba']), 'data'), ',');

    /**
     * Lista de parâmetros foi definida na aba?
     */
    if (parseBoolean(oprNot.call(this, isNullOrEmpty.call(this, ebfHtmlGetDOMAttribute.call(this, ebfHtmlGetElementById.call(this, this.context['Componente Aba']), 'tabParams'))))) {
        
      /**
       * Obter a lista de parâmetros
       */
      this.context['Lista'] = ebfHtmlGetDOMAttribute.call(this, ebfHtmlGetElementById.call(this, this.context['Componente Aba']), 'tabParams');

      return this.FlowConnector1();

    } else {

      /**
       * Criar objeto lista
       */
      this.context['Lista'] = ebfListCreate.call(this);

      /**
       * Obter altura e adicionar na lista
       */
      ebfSetElementAtList.call(this, this.context['Lista'], toLong.call(this, ebfHtmlCssGetStyle.call(this, ebfHtmlGetElementById.call(this, this.context['Componente Aba']), 'height')), null);

      /**
       * Obter largura adicionar na lista
       */
      ebfSetElementAtList.call(this, this.context['Lista'], toLong.call(this, ebfHtmlCssGetStyle.call(this, ebfHtmlGetElementById.call(this, this.context['Componente Aba']), 'width')), null);

      /**
       * Obter posicao y adicionar na lista
       */
      ebfSetElementAtList.call(this, this.context['Lista'], toLong.call(this, ebfHtmlCssGetStyle.call(this, ebfHtmlGetElementById.call(this, this.context['Componente Aba']), 'top')), null);

      /**
       * Obter posicao x adicionar na lista
       */
      ebfSetElementAtList.call(this, this.context['Lista'], toLong.call(this, ebfHtmlCssGetStyle.call(this, ebfHtmlGetElementById.call(this, this.context['Componente Aba']), 'left')), null);

      return this.FlowConnector1();

    }

  } else {

    /**
     * A lista está vazia?
     */
    if (parseBoolean(isNullOrEmpty.call(this, this.context['Lista']))) {
        
      /**
       * Mensagem de Alerta
       */
      ActWarningMessage('Componente Aba não existe ou o nome informado no componente menu está divergente!');

      /**
       * Fim
       */
      return null;

    } else {

      /**
       * Obter valor da posição X
       */
      this.context['PosicaoX'] = ebfGetElementFromList.call(this, this.context['Lista'], parseInt(4));

      /**
       * Obter valor da posição Y
       */
      this.context['PosicaoY'] = ebfGetElementFromList.call(this, this.context['Lista'], parseInt(3));

      /**
       * Obter valor da altura
       */
      this.context['Altura'] = ebfGetElementFromList.call(this, this.context['Lista'], parseInt(1));

      /**
       * Obter valor da largura
       */
      this.context['Largura'] = ebfGetElementFromList.call(this, this.context['Lista'], parseInt(2));

      /**
       * Obter valor da largura da aba
       */
      this.context['Largura da Aba'] = toLong.call(this, ebfGetElementFromList.call(this, this.context['Lista'], parseInt(7)));

      /**
       * Obter Propriedade Container
       */
      this.context['Container'] = ebfGetComponentProperty.call(this, null, this.context['Componente Aba'], 'Container');

      /**
       * Valida se o Container existe.
       */
      this.context['Container'] = (isNullOrEmpty.call(this, this.context['Container']) ? null : this.context['Container']);

      /**
       * Criar Aba
       */
      new AbaNovo(this, this.getSystem(), this.getForm()).run(ebfTranslate.call(this, ebfMapGetObject.call(this, this.context['Mapa'], 'abacontendomoldura'), null), this.context['PosicaoX'], this.context['PosicaoY'], this.context['Largura'], this.context['Altura'], ebfListCreate.call(this), this.context['Componente Aba'], true, true, toBoolean.call(this, ebfMapGetObject.call(this, ebfGetClientFormVariable.call(this, this.context['Componente Aba']), 'fecharaba')), null, null, parseInt(1), ebfMapGetObject.call(this, ebfGetClientFormVariable.call(this, this.context['Componente Aba']), 'Acessivel'), null, toBoolean.call(this, ebfMapGetObject.call(this, ebfGetClientFormVariable.call(this, this.context['Componente Aba']), 'Desdocar')), this.context['Largura da Aba'], this.context['Container']);


      return this.FlowExpression1();

    }

  }

}

AbaAdicionarNovaAba.prototype.FlowSubRoutine1 = function() {

    /**
     * Aba - Abrir Formulário na Moldura
     */
    new AbaAbrirFormularioNaMoldura(this, this.getSystem(), this.getForm()).run(this.context['Formulário'], this.context['Título'], this.context['Mapa'], '', this.context['Filtro']);

    return this.FlowEnd2();
  }

AbaAdicionarNovaAba.prototype.FlowExpression27 = function() {

    /**
     * Adicionar filtro a lista de filtros
     */
    ebfMapAddObject.call(this, ebfMapGetObject.call(this, this.context['Mapa'], 'filtros'), ebfTrim.call(this, this.context['Formulário']), this.context['Filtro']);

    /**
     * Aba - Criando abas
     */
    new AbaCriandoAbas(this, this.getSystem(), this.getForm()).run(this.context['Mapa']);

    /**
     * Aba - Abrir Formulário na Moldura
     */
    new AbaAbrirFormularioNaMoldura(this, this.getSystem(), this.getForm()).run(this.context['Formulário'], this.context['Título'], this.context['Mapa'], '', this.context['Filtro']);

    return this.FlowEnd2();
  }

AbaAdicionarNovaAba.prototype.FlowConnector1 = function() {

    /**
     * Verificar se o elemento fechar e gravar na lista
     */
    ebfSetElementAtList.call(this, this.context['Lista'], toBoolean.call(this, ebfGetElementFromList.call(this, this.context['Atributos'], parseInt(1))), null);

    /**
     * Verificar se o elemento desdoca e gravar na lista
     */
    ebfSetElementAtList.call(this, this.context['Lista'], toBoolean.call(this, ebfGetElementFromList.call(this, this.context['Atributos'], parseInt(2))), null);

    /**
     * Obter largura da aba e adicionar na lista
     */
    ebfSetElementAtList.call(this, this.context['Lista'], toLong.call(this, ebfGetElementFromList.call(this, this.context['Atributos'], parseInt(3))), null);

    /**
     * Definir variável local
     */
    ebfSetClientFormVariable.call(this, ebfConcat.call(this, this.context['Componente Aba'], 'propriedadeselementos'), this.context['Lista']);

    return this.FlowExpression1();
  }

AbaAdicionarNovaAba.prototype.FlowEnd2 = function() {

    /**
     * Fim
     */
    return null;
  }

AbaAdicionarNovaAba.prototype.FlowExpression1 = function() {

    /**
     * Obter mapa de propriedades !
     */
    this.context['Mapa'] = ebfGetClientFormVariable.call(this, this.context['Componente Aba']);

    /**
     * Existe susequencia ?
     */
    if (parseBoolean((oprNot.call(this, isNullOrEmpty.call(this, ebfMapGetObject.call(this, this.context['Mapa'], 'listaformularios'))) && ebfSearchSubstring.call(this, ebfMapGetObject.call(this, this.context['Mapa'], 'listaformularios'), this.context['Formulário'])))) {
        
      /**
       * Lista de filtros é nula?
       */
      if (parseBoolean(isNullOrEmpty.call(this, ebfMapGetObject.call(this, this.context['Mapa'], 'filtros')))) {
          
        return this.FlowSubRoutine1();

      } else {

        /**
         * Adicionar filtro a lista de filtros
         */
        ebfMapAddObject.call(this, ebfMapGetObject.call(this, this.context['Mapa'], 'filtros'), ebfTrim.call(this, this.context['Formulário']), this.context['Filtro']);

        return this.FlowSubRoutine1();

      }

    } else {

      /**
       * Adicionar formulário a lista de propriedades !
       */
      ebfMapAddObject.call(this, this.context['Mapa'], 'listaformularios', (isNullOrEmpty.call(this, ebfMapGetObject.call(this, this.context['Mapa'], 'listaformularios')) ? this.context['Formulário'] : ebfConcat.call(this, ebfMapGetObject.call(this, this.context['Mapa'], 'listaformularios'), ',', this.context['Formulário'])));

      /**
       * Adicionar título !
       */
      ebfMapAddObject.call(this, this.context['Mapa'], 'titulos', (isNullOrEmpty.call(this, ebfMapGetObject.call(this, this.context['Mapa'], 'titulos')) ? this.context['Título'] : ebfConcat.call(this, ebfMapGetObject.call(this, this.context['Mapa'], 'titulos'), ',', this.context['Título'])));

      /**
       * Lista de filtros é nula?
       */
      if (parseBoolean(isNullOrEmpty.call(this, ebfMapGetObject.call(this, this.context['Mapa'], 'filtros')))) {
          
        /**
         * Criar lista de filtros
         */
        ebfMapAddObject.call(this, this.context['Mapa'], 'filtros', ebfMapCreateObject.call(this));

        return this.FlowExpression27();

      } else {

        return this.FlowExpression27();

      }

    }
  }


function runAbaAdicionarNovaAba(parent, sys, formID, params) {
  var rule = new AbaAdicionarNovaAba(parent, sys, formID);
  rule.run.apply(rule, params);
}

function AbaAssociarEventoAoClicar(parent, sys, formID) {
  this.ruleName = 'Aba - Associar Evento ao Clicar';
  this.functionName = 'AbaAssociarEventoAoClicar';
  this.parent = parent;
  this.sys = sys;
  this.formID = formID;
  this.translations = new Map();
}

AbaAssociarEventoAoClicar.prototype = new Rule;

/**
 * Esta função executa a regra "Aba - Associar Evento ao Clicar"
 * @param Nome do componente equivale à variável this.context['Nome do componente']<br/>
 * @param Fluxo equivale à variável this.context['Fluxo']<br/>
 * @param Lista de Parâmetros equivale à variável this.context['Lista de Parâmetros']<br/>
 * @author master
 * @since 21/10/2014 16:39:59
 */
AbaAssociarEventoAoClicar.prototype.run = function() {
  document.ruleNameForException = 'Aba - Associar Evento ao Clicar';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Nome do componente'] = this.checkType(arguments[0], 'Letras');

  this.context['Fluxo'] = this.checkType(arguments[1], 'Letras');

  this.context['Lista de Parâmetros'] = this.checkType(arguments[2], 'Variante');


  /**
   * Parâmetros são nulos?
   */
  if (parseBoolean((isNullOrEmpty.call(this, this.context['Nome do componente']) && isNullOrEmpty.call(this, this.context['Fluxo'])))) {
      
    /**
     * Mensagem de Erro
     */
    ActErrorMessage('Informe os parâmetros obrigatórios!');

    return this.FlowEnd1();

  } else {

    /**
     * Associar Evento
     */
    ebfHtmlAttachFlowEvent.call(this, ebfHtmlGetElementById.call(this, this.context['Nome do componente']), 'onclick', this.context['Fluxo'], this.context['Lista de Parâmetros']);

    return this.FlowEnd1();

  }

}

AbaAssociarEventoAoClicar.prototype.FlowEnd1 = function() {

    /**
     * Fim
     */
    return null;
  }


function runAbaAssociarEventoAoClicar(parent, sys, formID, params) {
  var rule = new AbaAssociarEventoAoClicar(parent, sys, formID);
  rule.run.apply(rule, params);
}

