AbaDesancorar.prototype = new Rule;

/**
 * Esta função executa a regra "Aba - Desancorar"
 * @param Formulário que será aberto equivale à variável this.context['Formulário que será aberto']<br/>
 * @param Titulo da aba que será fechada equivale à variável this.context['Titulo da aba que será fechada']<br/>
 * @param Mapa de propriedades equivale à variável this.context['Mapa de propriedades']<br/>
 * @param MolduraFechar equivale à variável this.context['MolduraFechar']<br/>
 * @param Filtro da aba que será fechada equivale à variável this.context['Filtro da aba que será fechada']<br/>
 * @author Danilo
 * @since 27/01/2021 09:40:32
 */
AbaDesancorar.prototype.run = function() {
  document.ruleNameForException = 'Aba - Desancorar';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Formulário que será aberto'] = this.checkType(arguments[0], 'Letras');

  this.context['Titulo da aba que será fechada'] = this.checkType(arguments[1], 'Letras');

  this.context['Mapa de propriedades'] = this.checkType(arguments[2], 'Variante');

  this.context['MolduraFechar'] = this.checkType(arguments[3], 'Letras');

  this.context['Filtro da aba que será fechada'] = this.checkType(arguments[4], 'Letras');

  // Variáveis
  this.context['Formulário Principal'] = '';

  this.context['Lista de formulários'] = '';

  this.context['Títulos'] = '';

  this.context['Aba ativa'] = '';

  this.context['MolduraGeral'] = '';

  this.context['Nome do componente'] = '';

  this.context['Aux'] = '';

  this.context['Título da aba que será aberta'] = '';

  this.context['Lista de Filtros'] = null;

  this.context['Filtro da aba que será aberta'] = '';


  /**
   * INÍCIO OBTENÇÃO
   */

  /**
   * Obter do Mapa (Nome do Componente)
   */
  this.context['Nome do componente'] = ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'Nome');

  /**
   * Obter Variável de Sessão.
   */
  this.context['MolduraGeral'] = ebfGetClientFormVariable.call(this, 'MolduraGeral');

  /**
   * Obter nome do formulário
   */
  this.context['Formulário Principal'] = ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'formulario');

  /**
   * Obter lista de formulários
   */
  this.context['Lista de formulários'] = ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'listaformularios');

  /**
   * Obter lista de títulos
   */
  this.context['Títulos'] = ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'titulos');

  /**
   * Obter lista de filtros
   */
  this.context['Lista de Filtros'] = ebfMapGetObject.call(this, this.context['Mapa de propriedades'], 'filtros');

  /**
   * Aba - Abrir Formulário (Undock)
   */
  new AbaAbrirFormularioUndock(this, this.getSystem(), this.getForm()).run(this.context['MolduraFechar'], this.context['Lista de formulários'], this.context['Títulos'], this.context['MolduraGeral'], this.context['Lista de Filtros']);

  /**
   * Obter aba ativa
   */
  this.context['Aba ativa'] = ebfGetClientFormVariable.call(this, ebfConcat.call(this, 'abaativa', this.context['MolduraGeral']));

  /**
   * FIM OBTENÇÃO
   */

  /**
   * REMOVER DADOS DA ABA
   */

  /**
   * Remover formulário excluido da lista de formulários ligados as abas
   */
  this.context['Lista de formulários'] = ebfTrim.call(this, (ebfSearchSubstring.call(this, this.context['Lista de formulários'], ebfConcat.call(this, this.context['Formulário que será aberto'], ',')) ? ebfReplace.call(this, this.context['Lista de formulários'], ebfConcat.call(this, this.context['Formulário que será aberto'], ','), ebfTrim.call(this, '')) : (ebfSearchSubstring.call(this, this.context['Lista de formulários'], ebfConcat.call(this, ',', this.context['Formulário que será aberto'])) ? ebfReplace.call(this, this.context['Lista de formulários'], ebfConcat.call(this, ',', this.context['Formulário que será aberto']), ebfTrim.call(this, '')) : ebfReplace.call(this, this.context['Lista de formulários'], this.context['Formulário que será aberto'], ebfTrim.call(this, '')))));

  /**
   * Remover o título da lista de abas
   */
  this.context['Títulos'] = ebfTrim.call(this, (ebfSearchSubstring.call(this, this.context['Títulos'], ebfConcat.call(this, this.context['Titulo da aba que será fechada'], ',')) ? ebfReplace.call(this, this.context['Títulos'], ebfConcat.call(this, this.context['Titulo da aba que será fechada'], ','), '') : (ebfSearchSubstring.call(this, this.context['Títulos'], ebfConcat.call(this, ',', this.context['Titulo da aba que será fechada'])) ? ebfReplace.call(this, this.context['Títulos'], ebfConcat.call(this, ',', this.context['Titulo da aba que será fechada']), '') : ebfReplace.call(this, this.context['Títulos'], this.context['Titulo da aba que será fechada'], ''))));

  /**
   * Lista de Filtros é nula ou vazia?
   */
  if (parseBoolean(isNullOrEmpty.call(this, this.context['Lista de Filtros']))) {
      
    return this.FlowDecision2();

  } else {

    /**
     * Remover o filtro da lista de filtros
     */
    ebfMapRemoveObject.call(this, this.context['Lista de Filtros'], ebfTrim.call(this, this.context['Formulário que será aberto']));

    return this.FlowDecision2();

  }

}

AbaDesancorar.prototype.FlowExpression8 = function() {

    /**
     * Obter primeiro formulário da lista
     */
    this.context['Formulário que será aberto'] = (ebfSearchSubstring.call(this, this.context['Lista de formulários'], ',') ? ebfTrim.call(this, ebfSubstring.call(this, this.context['Lista de formulários'], parseInt(1), oprSubtract.call(this, ebfIndexOf.call(this, this.context['Lista de formulários'], ','), parseInt(1)))) : ebfTrim.call(this, this.context['Lista de formulários']));

    /**
     * Obter primeiro título da lista
     */
    this.context['Título da aba que será aberta'] = (ebfSearchSubstring.call(this, this.context['Títulos'], ',') ? ebfTrim.call(this, ebfSubstring.call(this, this.context['Títulos'], parseInt(1), oprSubtract.call(this, ebfIndexOf.call(this, this.context['Títulos'], ','), parseInt(1)))) : ebfTrim.call(this, this.context['Títulos']));

    /**
     * Obter o primeiro filtro da lista
     */
    this.context['Filtro da aba que será aberta'] = (oprNot.call(this, isNullOrEmpty.call(this, this.context['Lista de Filtros'])) ? ebfGetElementFromList.call(this, this.context['Lista de Filtros'], parseInt(1)) : '');

    /**
     * Aba - Abrir Formulário na Moldura
     */
    new AbaAbrirFormularioNaMoldura(this, this.getSystem(), this.getForm()).run(this.context['Formulário que será aberto'], this.context['Título da aba que será aberta'], this.context['Mapa de propriedades'], null, this.context['Filtro da aba que será aberta']);

    /**
     * Atribuir títulos
     */
    ebfMapAddObject.call(this, this.context['Mapa de propriedades'], 'titulos', this.context['Títulos']);

    /**
     * Atribuir filtros
     */
    ebfMapAddObject.call(this, this.context['Mapa de propriedades'], 'filtros', (isNullOrEmpty.call(this, this.context['Lista de Filtros']) ? ebfListCreate.call(this) : this.context['Lista de Filtros']));

    /**
     * Criar lista apartir dos formulários existentes
     */
    ebfMapAddObject.call(this, this.context['Mapa de propriedades'], 'listaformularios', this.context['Lista de formulários']);

    /**
     * Atribuir títulos selecionado
     */
    ebfMapAddObject.call(this, this.context['Mapa de propriedades'], 'tituloselecionado', this.context['Título da aba que será aberta']);

    /**
     * Obter componente
     */
    this.context['Aux'] = ebfHtmlGetMakerElementById.call(this, this.context['MolduraFechar']);

    /**
     * Aux é nulo ou vazio?
     */
    if (parseBoolean(isNullOrEmpty.call(this, this.context['Aux']))) {
        
      return this.FlowSubRoutine3();

    } else {

      /**
       * Limpar moldura
       */
      ebfGroupBoxClean.call(this, null, this.context['MolduraFechar']);

      /**
       * Destruir Componente
       */
      ebfDestroyComponent.call(this, this.context['MolduraFechar']);

      return this.FlowSubRoutine3();

    }
  }

AbaDesancorar.prototype.FlowDecision2 = function() {

    /**
     * Lista de Formulários ou Titulos é vázia?
     */
    if (parseBoolean((isNullOrEmpty.call(this, this.context['Lista de formulários']) || isNullOrEmpty.call(this, this.context['Títulos'])))) {
        
      /**
       * Destruir Componente
       */
      ebfDestroyComponent.call(this, this.context['MolduraGeral']);

      /**
       * Atribuir títulos
       */
      ebfMapAddObject.call(this, this.context['Mapa de propriedades'], 'titulos', this.context['Títulos']);

      /**
       * Atribuir filtros
       */
      ebfMapAddObject.call(this, this.context['Mapa de propriedades'], 'filtros', (isNullOrEmpty.call(this, this.context['Lista de Filtros']) ? ebfListCreate.call(this) : this.context['Lista de Filtros']));

      /**
       * Criar lista apartir dos formulários existentes
       */
      ebfMapAddObject.call(this, this.context['Mapa de propriedades'], 'listaformularios', this.context['Lista de formulários']);

      /**
       * Atribuir títulos selecionado
       */
      ebfMapAddObject.call(this, this.context['Mapa de propriedades'], 'tituloselecionado', this.context['Titulo da aba que será fechada']);

      /**
       * Atribuir novo mapa de propriedades
       */
      ebfSetRuleExecutionTime.call(this, 'Aba - Criando abas', ebfListParamsCreate.call(this, this.context['Mapa de propriedades']), '100');

      /**
       * Remover DIV Pai
       */
      ebfHtmlRemoveChild.call(this, ebfHtmlGetParent.call(this, ebfHtmlGetElementById.call(this, this.context['Nome do componente'])), ebfHtmlGetElementById.call(this, this.context['Nome do componente']));

      /**
       * Remover a div Disabled
       */
      ebfHtmlRemoveChild.call(this, ebfHtmlGetParent.call(this, ebfHtmlGetElementById.call(this, ebfConcat.call(this, 'disable', this.context['Nome do componente']))), ebfHtmlGetElementById.call(this, ebfConcat.call(this, 'disable', this.context['Nome do componente'])));

      return this.FlowEnd2();

    } else {

      /**
       * Verificar indice
       */
      if (parseBoolean(ebfIndexOf.call(this, this.context['Lista de formulários'], ','))) {
          
        /**
         * Remover virgula
         */
        this.context['Lista de formulários'] = ebfReplace.call(this, this.context['Lista de formulários'], ',', '');

        return this.FlowExpression8();

      } else {

        return this.FlowExpression8();

      }

    }
  }

AbaDesancorar.prototype.FlowSubRoutine3 = function() {

    /**
     * Aba - Criando abas
     */
    new AbaCriandoAbas(this, this.getSystem(), this.getForm()).run(this.context['Mapa de propriedades']);

    return this.FlowEnd2();
  }

AbaDesancorar.prototype.FlowEnd2 = function() {

    /**
     * Fim
     */
    return null;
  }


