/**
 * Esta função executa a regra "Aba - Interface - Incluir formulário na grade"
 * @param Guid equivale à variável this.context['Guid']<br/>
 * @author Janpier
 * @since 04/03/2022 12:36:44
 */
AbaInterfaceIncluirFormularioNaGrade.prototype.run = function() {
  document.ruleNameForException = 'Aba - Interface - Incluir formulário na grade';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Guid'] = this.checkType(arguments[0], 'Letras');

  // Variáveis
  this.context['Total de linhas'] = 0;

  this.context['Nome do formulário'] = '';

  this.context['count'] = 0;

  this.context['Nome do form'] = '';

  this.context['logico'] = false;

  this.context['logico'] = false;

  /**
   * Guid é nulo ou vazio?
   */
  if (parseBoolean(isNullOrEmpty.call(this, this.context['Guid']))) {
      
    /**
     * Fim
     */
    return null;

  } else {

    /**
     * Aba - Interface - Obter nome do formulário
     */
    this.context['Nome do formulário'] = executeSyncJavaRule.call(this, this.getSystem(), this.getForm(), 'Aba - Interface - Obter nome do formulário', [this.context['Guid']]);

    /**
     * Obter total de linhas da grade
     */
    this.context['Total de linhas'] = toLong.call(this, ebfGridRowCount.call(this, 'MakerGrid1'));

    /**
     * atualiza total
     */
    (isGreaterOrEqual.call(this, this.context['Total de linhas'], parseInt(1)) ? oprSubtract.call(this, this.context['Total de linhas'], parseInt(1)) : this.context['Total de linhas']);

    /**
     * Compara o form selecionado com os que já foram selecionados
     */
    while (parseBoolean((isMinor.call(this, this.context['count'], this.context['Total de linhas']) && oprNot.call(this, this.context['logico'])))) {

      /**
       * Obtem nome dos forms
       */
      this.context['Nome do form'] = ebfGridGetValue.call(this, 'MakerGrid1', this.context['count'], 'Formulário');

      /**
       * Form já foi seleionado?
       */
      this.context['logico'] = isEqual.call(this, this.context['Nome do form'], this.context['Nome do formulário']);

      /**
       * count ++
       */
      this.context['count'] = oprAdd.call(this, this.context['count'], parseInt(1));
    }

    /**
     * já foi selecionado?
     */
    if (parseBoolean(this.context['logico'])) {
        
      /**
       * Mensagem de Alerta
       */
      ActNewWarningMessage(null, 'Formulário já selecionado!', null, null);

      return this.FlowEnd1();

    } else {

      /**
       * Inserir linha na grade
       */
      ebfGridInsertRow.call(this, 'MakerGrid1');

      /**
       * Atribuir nome do formulário a grid
       */
      ebfGridSetValue.call(this, 'MakerGrid1', this.context['Total de linhas'], 'Formulário', this.context['Nome do formulário']);

      /**
       * Aba - Definir lista de formulários
       */
      new AbaDefinirListaDeFormularios(this, this.getSystem(), this.getForm()).run(this.context['Guid']);

      return this.FlowEnd1();

    }

  }

}

