  /**
   * insere lista 1 na final
   */
  ebfSetElementAtList.call(this, this.context['Lista final'], ebfListParamsCreate.call(this, ebfListParamsCreate.call(this, parseInt(1), parseInt(2)), this.context['lista 1']), null);

