      ebfGridSetValue.call(this, 'TMAKERGRID', oprSubtract.call(this, this.context['Contador'], parseFloat(1)), 'Tipo', ebfHtmlGetDOMAttribute.call(this, ebfHtmlGetDOMAttribute.call(this, this.context['SERIES'], ebfGetElementFromList.call(this, this.context['Lista de Séries'], this.context['Contador'])), 'tipo'));

