GraficoInterfaceCriarCampos.prototype = new Rule;

/**
 * Esta função executa a regra "Gráfico - Interface - Criar Campos"
 * @param Tabela com campos equivale à variável this.context['Tabela com campos']<br/>
 * @author Thiago Vinhas
 * @since 03/03/2016 16:24:07
 */
GraficoInterfaceCriarCampos.prototype.run = function() {
  document.ruleNameForException = 'Gráfico - Interface - Criar Campos';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Tabela com campos'] = this.checkType(arguments[0], 'Variante');

  // Variáveis
  this.context['Tamanho da lista'] = 0;

  this.context['contador'] = 0;

  this.context['contador'] = parseInt(1);

  /**
   * Tamanho da lista
   */
  this.context['Tamanho da lista'] = ebfListLength.call(this, this.context['Tabela com campos']);

  /**
   * Limpar o campo etiqueta
   */
  ebfComboClean.call(this, 'MakerComboBox7');

  /**
   * Limpar o campo valor
   */
  ebfComboClean.call(this, 'MakerComboBox14');

  /**
   * Limpar o campo Id do Grupo
   */
  ebfComboClean.call(this, 'MakerComboBox15');

  /**
   * Limpar o campo Data inicio
   */
  ebfComboClean.call(this, 'MakerComboBox16');

  /**
   * Limpar o campo Data fim
   */
  ebfComboClean.call(this, 'MakerComboBox17');

  /**
   * Limpar o campo porcentagem da tarefa
   */
  ebfComboClean.call(this, 'MakerComboBox18');

  /**
   * Limpar o campo depêndencias
   */
  ebfComboClean.call(this, 'MakerComboBox19');

  /**
   * Contador é menor que o tamanho da lista?
   */
  while (parseBoolean(isMinorOrEqual.call(this, this.context['contador'], this.context['Tamanho da lista']))) {

    /**
     * Criar o campo Etiqueta
     */
    ebfComboPut.call(this, 'MakerComboBox7', ebfGetElementFromList.call(this, this.context['Tabela com campos'], this.context['contador']), ebfGetElementFromList.call(this, this.context['Tabela com campos'], this.context['contador']));

    /**
     * Criar o campo valor Y
     */
    ebfComboPut.call(this, 'MakerComboBox14', ebfGetElementFromList.call(this, this.context['Tabela com campos'], this.context['contador']), ebfGetElementFromList.call(this, this.context['Tabela com campos'], this.context['contador']));

    /**
     * Criar o campo Id do grupo
     */
    ebfComboPut.call(this, 'MakerComboBox15', ebfGetElementFromList.call(this, this.context['Tabela com campos'], this.context['contador']), ebfGetElementFromList.call(this, this.context['Tabela com campos'], this.context['contador']));

    /**
     * Criar o campo Data de Inicio
     */
    ebfComboPut.call(this, 'MakerComboBox16', ebfGetElementFromList.call(this, this.context['Tabela com campos'], this.context['contador']), ebfGetElementFromList.call(this, this.context['Tabela com campos'], this.context['contador']));

    /**
     * Criar o campo Data Fim
     */
    ebfComboPut.call(this, 'MakerComboBox17', ebfGetElementFromList.call(this, this.context['Tabela com campos'], this.context['contador']), ebfGetElementFromList.call(this, this.context['Tabela com campos'], this.context['contador']));

    /**
     * Criar o campo Porcentagem da tarefa
     */
    ebfComboPut.call(this, 'MakerComboBox18', ebfGetElementFromList.call(this, this.context['Tabela com campos'], this.context['contador']), ebfGetElementFromList.call(this, this.context['Tabela com campos'], this.context['contador']));

    /**
     * Criar o campo Dependencias
     */
    ebfComboPut.call(this, 'MakerComboBox19', ebfGetElementFromList.call(this, this.context['Tabela com campos'], this.context['contador']), ebfGetElementFromList.call(this, this.context['Tabela com campos'], this.context['contador']));

    /**
     * Contador ++
     */
    this.context['contador'] = oprAdd.call(this, this.context['contador'], parseFloat(1));
  }

  /**
   * Fim
   */
  return null;

}

