GraficoInterfaceInserirLinhaNaGrade.prototype = new Rule;

/**
 * Esta função executa a regra "Gráfico - Interface - Inserir Linha na Grade"
 * @param Nome equivale à variável this.context['Nome']<br/>
 * @param Tipo equivale à variável this.context['Tipo']<br/>
 * @param Fonte de Dados equivale à variável this.context['Fonte de Dados']<br/>
 * @author master
 * @since 2/3/2016 6:09:02 PM
 */
GraficoInterfaceInserirLinhaNaGrade.prototype.run = function() {
  document.ruleNameForException = 'Gráfico - Interface - Inserir Linha na Grade';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Nome'] = this.checkType(arguments[0], 'Letras');

  this.context['Tipo'] = this.checkType(arguments[1], 'Variante');

  this.context['Fonte de Dados'] = this.checkType(arguments[2], 'Letras');

  // Variáveis
  this.context['Guid'] = '';

  this.context['Número de Linhas'] = 0;

  this.context['Número de Linhas'] = parseInt(0);

  /**
   * Nome vazio?
   */
  if (parseBoolean(isNullOrEmpty.call(this, this.context['Nome']))) {
      
    /**
     * Erro : Informando que o "Nome" é Obrigatório
     */
    ActErrorMessage('Favor preencher o campo \"Nome\".');

    /**
     * Fim
     */
    return null;

  } else {

    /**
     * Tipo vazio?
     */
    if (parseBoolean(isNullOrEmpty.call(this, this.context['Tipo']))) {
        
      /**
       * Erro: Informando que o "Tipo" é Obrigatório
       */
      ActErrorMessage('Favor preencher o campo \"Tipo\".');

      /**
       * Fim
       */
      return null;

    } else {

      /**
       * Gráfico - Interface - Gerar GUID
       */
      this.context['Guid'] = executeSyncJavaRule.call(this, this.getSystem(), this.getForm(), 'Gráfico - Interface - Gerar GUID');

      /**
       * Inserir Linha na Grade
       */
      ebfGridInsertRow.call(this, 'TMAKERGRID');

      /**
       * Obtém a qtde de linhas
       */
      this.context['Número de Linhas'] = ebfGridRowCount.call(this, 'TMAKERGRID');

      /**
       * Definir valor da GUID
       */
      ebfFormChangeComponentValue.call(this, '{087870BA-3DB8-4732-B1C8-78BBC8606FD5}', 'guid', this.context['Guid']);

      /**
       * Insire o Nome
       */
      ebfGridSetValue.call(this, 'TMAKERGRID', oprSubtract.call(this, this.context['Número de Linhas'], parseFloat(1)), 'Nome da série', this.context['Nome']);

      /**
       * Insire o tipo
       */
      ebfGridSetValue.call(this, 'TMAKERGRID', oprSubtract.call(this, this.context['Número de Linhas'], parseFloat(1)), 'Tipo', this.context['Tipo']);

      /**
       * Insire GUID
       */
      ebfGridSetValue.call(this, 'TMAKERGRID', oprSubtract.call(this, this.context['Número de Linhas'], parseFloat(1)), 'GUID', this.context['Guid']);

      /**
       * Gráfico - Interface - Executar Inserção
       */
      new GraficoInterfaceExecutarInsercao(this, this.getSystem(), this.getForm()).run(this.context['Guid'], this.context['Nome'], this.context['Tipo'], this.context['Fonte de Dados']);

      /**
       * Gráfico - Interface - Limpar Componentes
       */
      new GraficoInterfaceLimparComponentes(this, this.getSystem(), this.getForm()).run();

      /**
       * Oculta o campo SQL e Modificar Campos
       */
      ebfGroupBoxEnabledComponents.call(this, 'MakerBevel2', false);

      /**
       * Fim
       */
      return null;

    }

  }

}

