/**
 * Esta função executa a regra "Gráfico - Séries Novo - Criar gSerie"
 * @param Lista de series equivale à variável this.context['Lista de series']<br/>
 * @author Janpier dos Santos
 * @since 06/10/2016 09:19:08
 */
GraficoSeriesNovoCriarGserie.prototype.run = function() {
  document.ruleNameForException = 'Gráfico - Séries Novo - Criar gSerie';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Lista de series'] = this.checkType(arguments[0], 'Variante');

  // Variáveis
  this.context['Tamanho da lista'] = 0;

  this.context['Contador'] = 0;

  this.context['JSON'] = null;

  this.context['serie'] = null;

  this.context['GUID'] = null;

  this.context['Contador'] = parseInt(1);

  /**
   * Criar o Json Vazio
   */
  this.context['JSON'] = ebfCreateObjectJSON.call(this, '{}');

  /**
   * Obter o tamanho da lista
   */
  this.context['Tamanho da lista'] = ebfListLength.call(this, this.context['Lista de series']);

  /**
   * Contador menor ou igual ao tamanho da lista?
   */
  while (parseBoolean(isMinorOrEqual.call(this, this.context['Contador'], this.context['Tamanho da lista']))) {

    /**
     * Obter a série atual
     */
    this.context['serie'] = ebfGetElementFromList.call(this, this.context['Lista de series'], this.context['Contador']);

    /**
     * Criar GUID
     */
    this.context['GUID'] = ebfConcat.call(this, 'S', ebfRandom.call(this, parseInt(9)), ebfRandom.call(this, parseInt(9)), ebfRandom.call(this, parseInt(9)), ebfRandom.call(this, parseInt(9)), ebfRandom.call(this, parseInt(9)), ebfRandom.call(this, parseInt(9)));

    /**
     * Acrensenta uma nova série
     */
    ebfHtmlSetDOMAttribute.call(this, this.context['JSON'], this.context['GUID'], ebfCreateObjectJSON.call(this, ebfConcat.call(this, '{\"nome\" :\"', ebfGetElementFromList.call(this, this.context['serie'], parseInt(1)), '\", \"tipo\": \"', ebfGetElementFromList.call(this, this.context['serie'], parseInt(2)), '\", \"sql\": \"\", \"campos\": \"\"}')));

    /**
     * Atualiza o valor da propriedade sql
     */
    ebfHtmlSetDOMAttribute.call(this, ebfHtmlGetDOMAttribute.call(this, this.context['JSON'], this.context['GUID']), 'sql', ebfGetElementFromList.call(this, this.context['serie'], parseInt(3)));

    /**
     * Atualiza o valor da propriedade campos
     */
    ebfHtmlSetDOMAttribute.call(this, ebfHtmlGetDOMAttribute.call(this, this.context['JSON'], this.context['GUID']), 'campos', ebfReplaceAll.call(this, ebfGetElementFromList.call(this, this.context['serie'], parseInt(4)), ',', ';'));

    /**
     * Contador ++
     */
    this.context['Contador'] = oprAdd.call(this, this.context['Contador'], parseFloat(1));
  }

  /**
   * Obtenho o texto JSON
   */
  this.context['JSON'] = ebfGetJSONText.call(this, this.context['JSON'], null);

  /**
   * Fim
   */
  return this.context['JSON'];

}

