GraficoSeriesNovoDefinirPosicaoDaLegenda.prototype = new Rule;

/**
 * Esta função executa a regra "Gráfico - Séries Novo - Definir Posição da Legenda"
 * @param mapa equivale à variável this.context['mapa']<br/>
 * @param posiçao equivale à variável this.context['posiçao']<br/>
 * @author Thiago Vinhas
 * @since 05/08/2016 15:17:59
 */
GraficoSeriesNovoDefinirPosicaoDaLegenda.prototype.run = function() {
  document.ruleNameForException = 'Gráfico - Séries Novo - Definir Posição da Legenda';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['mapa'] = this.checkType(arguments[0], 'Variante');

  this.context['posiçao'] = this.checkType(arguments[1], 'Letras');


  /**
   * A posição é nula?
   */
  if (parseBoolean(isNullOrEmpty.call(this, this.context['posiçao']))) {
      
    /**
     * Fim
     */
    return this.context['mapa'];

  } else {

    /**
     * Posição da legenda é esquerda?
     */
    if (parseBoolean(ebfSearchSubstring.call(this, ebfToLowerCase.call(this, this.context['posiçao']), 'esquerda'))) {
        
      /**
       * Definir a posição da legenda na esquerda
       */
      ebfMapAddObject.call(this, this.context['mapa'], 'PosicaoLegenda', 'left');

      /**
       * Fim
       */
      return this.context['mapa'];

    } else {

      /**
       * Posição da legenda é direita?
       */
      if (parseBoolean(ebfSearchSubstring.call(this, ebfToLowerCase.call(this, this.context['posiçao']), 'direita'))) {
          
        /**
         * Definir a posição da legenda na direita
         */
        ebfMapAddObject.call(this, this.context['mapa'], 'PosicaoLegenda', 'right');

        /**
         * Fim
         */
        return this.context['mapa'];

      } else {

        /**
         * Posição da legenda é topo
         */
        if (parseBoolean(ebfSearchSubstring.call(this, ebfToLowerCase.call(this, this.context['posiçao']), 'topo'))) {
            
          /**
           * Definir a posição da legenda no topo
           */
          ebfMapAddObject.call(this, this.context['mapa'], 'PosicaoLegenda', 'top');

          /**
           * Fim
           */
          return this.context['mapa'];

        } else {

          /**
           * Posição da legenda é baixo?
           */
          if (parseBoolean(ebfSearchSubstring.call(this, ebfToLowerCase.call(this, this.context['posiçao']), 'baixo'))) {
              
            /**
             * Definir a posição da legenda em baixo
             */
            ebfMapAddObject.call(this, this.context['mapa'], 'PosicaoLegenda', 'bottom');

            /**
             * Fim
             */
            return this.context['mapa'];

          } else {

            /**
             * Fim
             */
            return this.context['mapa'];

          }

        }

      }

    }

  }

}

