/**
 * Esta função executa a regra "Integracao - Configuracoes - Bibliotecas - Insere na grade"
 * @param URL equivale à variável this.context['URL']<br/>
 * @author Janpier dos Santos
 * @since 11/07/2018 17:55:17
 */
IntegracaoConfiguracoesBibliotecasInsereNaGrade.prototype.run = function() {
  document.ruleNameForException = 'Integracao - Configuracoes - Bibliotecas - Insere na grade';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['URL'] = this.checkType(arguments[0], 'Letras');

  // Variáveis
  this.context['Linhas da Grade'] = 0;

  this.context['contador'] = 0;

  this.context['URLRegistro'] = '';

  this.context['contador'] = parseInt(0);

  /**
   * URL é nulo ou vazio
   */
  if (parseBoolean(isNullOrEmpty.call(this, this.context['URL']))) {
      
    /**
     * Mensagem de Alerta
     */
    ActWarningMessage('Insira o endereço de uma biblioteca para adicionar na grade');

    /**
     * Fim
     */
    return null;

  } else {

    /**
     * Obtém total de linhas da grade
     */
    this.context['Linhas da Grade'] = ebfGridRowCount.call(this, 'MakerGrid1');

    /**
     * Contador é maior que a quantidade de registros
     */
    while (parseBoolean(oprNot.call(this, isGreaterOrEqual.call(this, this.context['contador'], this.context['Linhas da Grade'])))) {

      /**
       * Obtém URL do registro
       */
      this.context['URLRegistro'] = ebfGridGetValue.call(this, 'MakerGrid1', this.context['contador'], 'Biblioteca');

      /**
       * URL são iguais
       */
      if (parseBoolean(isEqual.call(this, this.context['URLRegistro'], this.context['URL']))) {
          
        /**
         * Mensagem de Alerta
         */
        ActWarningMessage('A biblioteca já foi inserida na grade');

        /**
         * Fim
         */
        return null;

      } else {

        /**
         * Incrementa contador
         */
        this.context['contador'] = oprAdd.call(this, this.context['contador'], parseInt(1));

      }
    }

    /**
     * Insere linha na grade
     */
    ebfGridInsertRow.call(this, 'MakerGrid1');

    /**
     * Biblioteca de fonte
     */
    if (parseBoolean(toBoolean.call(this, ebfFormGetComponentValue.call(this, '{029903E3-52E7-45F7-ABB4-269415322DF3}', 'TMAKERCHECKBOX')))) {
        
      /**
       * Atribui valor da URL na linha
       */
      ebfGridSetValue.call(this, 'MakerGrid1', this.context['Linhas da Grade'], 'Biblioteca', ebfConcat.call(this, 'fonte: ', this.context['URL']));

      return this.FlowExpression5();

    } else {

      /**
       * Atribui valor da URL na linha
       */
      ebfGridSetValue.call(this, 'MakerGrid1', this.context['Linhas da Grade'], 'Biblioteca', this.context['URL']);

      return this.FlowExpression5();

    }

  }

}

