IntegracaoConfiguracoesInserirEvento.prototype = new Rule;

/**
 * Esta função executa a regra "Integracao - Configuracoes - Inserir evento"
 * @author master
 * @since 07/08/2017 10:23:46
 */
IntegracaoConfiguracoesInserirEvento.prototype.run = function() {
  document.ruleNameForException = 'Integracao - Configuracoes - Inserir evento';
  this.context = new Array();

  // Variáveis
  this.context['Linha selecionada'] = 0;

  this.context['Id do elemento'] = '';

  this.context['Fluxo maker'] = '';

  this.context['Acao DOM'] = '';

  this.context['Lista de Parametros'] = null;

  this.context['Contador'] = 0;

  this.context['Parametro atual'] = null;

  this.context['Valor do Componente'] = '';

  this.context['Nome do Componente'] = '';

  this.context['Parametros na Grade'] = '';

  this.context['Linha selecionada'] = parseInt(-1);
  this.context['Contador'] = parseInt(1);

  /**
   * Obtém linha selecionada
   */
  this.context['Linha selecionada'] = ebfGridGetSelectedRow.call(this, 'TMAKERGRID1');

  /**
   * nenhuma linha selecionada
   */
  if (parseBoolean(isMinor.call(this, this.context['Linha selecionada'], '0'))) {
      
    /**
     * Mensagem de Alerta
     */
    ActWarningMessage('Selecione um elemento na grade para vincular o fluxo');

    /**
     * Fim
     */
    return null;

  } else {

    /**
     * Obtém Id do elemento
     */
    this.context['Id do elemento'] = ebfGridGetValue.call(this, 'TMAKERGRID1', this.context['Linha selecionada'], 'ID');

    /**
     * Obtém linha selecionada
     */
    this.context['Linha selecionada'] = ebfGridGetSelectedRow.call(this, 'MakerGrid3');

    /**
     * nenhuma linha selecionada
     */
    if (parseBoolean(isMinor.call(this, this.context['Linha selecionada'], '0'))) {
        
      /**
       * Mensagem de Alerta
       */
      ActWarningMessage('Selecione o tipo de evento na grade para vincular o fluxo');

      /**
       * Fim
       */
      return null;

    } else {

      /**
       * Obtém evento DOM
       */
      this.context['Acao DOM'] = ebfGridGetValue.call(this, 'MakerGrid3', this.context['Linha selecionada'], 'Ação');

      /**
       * Obtém fluxo maker
       */
      this.context['Fluxo maker'] = ebfFormGetLookupName.call(this, '{029903E3-52E7-45F7-ABB4-269415322DF3}', 'MakerLookup1');

      /**
       * Nada selecionado
       */
      if (parseBoolean(isNullOrEmpty.call(this, this.context['Fluxo maker']))) {
          
        /**
         * Mensagem de Alerta
         */
        ActWarningMessage('Selecione um fluxo na lista para vincular ao elemento.');

        /**
         * Fim
         */
        return null;

      } else {

        /**
         * Obtém parâmetros
         */
        this.context['Lista de Parametros'] = ebfHtmlChildNodes.call(this, ebfHtmlGetElementById.call(this, 'TMAKERBEVEL'));

        /**
         * Lista é vazia
         */
        if (parseBoolean((isNullOrEmpty.call(this, this.context['Lista de Parametros']) || isMinorOrEqual.call(this, ebfListLength.call(this, this.context['Lista de Parametros']), parseInt(0))))) {
            
          return this.FlowExpression18();

        } else {

          /**
           * Contador é menor que o tamanho da lista
           */
          while (parseBoolean(isMinorOrEqual.call(this, this.context['Contador'], ebfListLength.call(this, this.context['Lista de Parametros'])))) {

            /**
             * Obtém elemento do parâmetro
             */
            this.context['Parametro atual'] = ebfGetElementFromList.call(this, this.context['Lista de Parametros'], this.context['Contador']);

            /**
             * Obtém nome do componente
             */
            this.context['Nome do Componente'] = ebfHtmlGetAttribute.call(this, this.context['Parametro atual'], 'id');

            /**
             * Obtém conteúdo do componente
             */
            this.context['Valor do Componente'] = ebfFormGetComponentValue.call(this, '{029903E3-52E7-45F7-ABB4-269415322DF3}', this.context['Nome do Componente']);

            /**
             * Concatena parâmetro
             */
            this.context['Parametros na Grade'] = (isNullOrEmpty.call(this, this.context['Valor do Componente']) ? ebfConcat.call(this, this.context['Parametros na Grade'], '\" \"||') : ebfConcat.call(this, this.context['Parametros na Grade'], '\"', this.context['Valor do Componente'], '\"||'));

            /**
             * Incrementa contador
             */
            this.context['Contador'] = oprAdd.call(this, this.context['Contador'], parseInt(1));
          }

          /**
           * Remove última subsequência
           */
          this.context['Parametros na Grade'] = ebfSubstring.call(this, this.context['Parametros na Grade'], parseInt(1), oprSubtract.call(this, ebfLength.call(this, this.context['Parametros na Grade']), parseInt(2)));

          return this.FlowExpression18();

        }

      }

    }

  }

}

IntegracaoConfiguracoesInserirEvento.prototype.FlowExpression18 = function() {

    /**
     * Insere linha na grade
     */
    ebfGridInsertRow.call(this, 'MakerGrid2');

    /**
     * Insere elemento
     */
    ebfGridSetValue.call(this, 'MakerGrid2', oprSubtract.call(this, ebfGridRowCount.call(this, 'MakerGrid2'), parseInt(1)), 'Elemento', this.context['Id do elemento']);

    /**
     * Insere ação
     */
    ebfGridSetValue.call(this, 'MakerGrid2', oprSubtract.call(this, ebfGridRowCount.call(this, 'MakerGrid2'), parseInt(1)), 'Ação', this.context['Acao DOM']);

    /**
     * Insere fluxo
     */
    ebfGridSetValue.call(this, 'MakerGrid2', oprSubtract.call(this, ebfGridRowCount.call(this, 'MakerGrid2'), parseInt(1)), 'Fluxo a ser executado', this.context['Fluxo maker']);

    /**
     * Insere parametros
     */
    ebfGridSetValue.call(this, 'MakerGrid2', oprSubtract.call(this, ebfGridRowCount.call(this, 'MakerGrid2'), parseInt(1)), 'Parâmetros', this.context['Parametros na Grade']);

    /**
     * Integracao - Configuracoes - Salvar
     */
    new IntegracaoConfiguracoesSalvar(this, this.getSystem(), this.getForm()).run(ebfFormGetComponentValue.call(this, '{029903E3-52E7-45F7-ABB4-269415322DF3}', 'MakerMemo1'), ebfFormGetComponentValue.call(this, '{029903E3-52E7-45F7-ABB4-269415322DF3}', 'MakerMemo3'), ebfFormGetComponentValue.call(this, '{029903E3-52E7-45F7-ABB4-269415322DF3}', 'MakerMemo2'));

    /**
     * Limpa fluxo atual
     */
    ebfFormSetLookupName.call(this, '{029903E3-52E7-45F7-ABB4-269415322DF3}', 'MakerLookup1', null);

    /**
     * Limpa parâmetros
     */
    ebfGroupBoxClean.call(this, '{029903E3-52E7-45F7-ABB4-269415322DF3}', 'TMAKERBEVEL');

    /**
     * Fim
     */
    return null;
  }


