IntegracaoConfiguracoesSalvar.prototype = new Rule;

/**
 * Esta função executa a regra "Integracao - Configuracoes - Salvar"
 * @param HTML equivale à variável this.context['HTML']<br/>
 * @param JavaScript equivale à variável this.context['JavaScript']<br/>
 * @param CSS equivale à variável this.context['CSS']<br/>
 * @author master
 * @since 07/08/2017 14:31:20
 */
IntegracaoConfiguracoesSalvar.prototype.run = function() {
  document.ruleNameForException = 'Integracao - Configuracoes - Salvar';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['HTML'] = this.checkType(arguments[0], 'Letras');

  this.context['JavaScript'] = this.checkType(arguments[1], 'Letras');

  this.context['CSS'] = this.checkType(arguments[2], 'Letras');

  // Variáveis
  this.context['contador'] = 0;

  this.context['Tamanho da grade'] = 0;

  this.context['Endereço da linha'] = '';

  this.context['Bibliotecas_URL'] = '';

  this.context['JSON'] = null;

  this.context['Id do elemento'] = '';

  this.context['Evento DOM'] = '';

  this.context['Fluxo maker'] = '';

  this.context['Lista de Eventos'] = '';

  this.context['Lista de Parametros'] = '';

  this.context['ResultMaker'] = '';

  this.context['GUID'] = '';

  this.context['JSON Retorno'] = null;

  this.context['contador'] = parseInt(1);

  /**
   * Obtém variável local
   */
  this.context['ResultMaker'] = ebfGetLocalVariable.call(this, 'result_maker');

  /**
   * É nulo ou vazio
   */
  if (parseBoolean(isNullOrEmpty.call(this, this.context['ResultMaker']))) {
      
    return this.FlowSubRoutine5();

  } else {

    /**
     * Integracao - Configuracoes - Decodificar Base64
     */
    this.context['ResultMaker'] = executeSyncJavaRule.call(this, this.getSystem(), this.getForm(), 'Integracao - Configuracoes - Decodificar Base64', [this.context['ResultMaker']]);

    /**
     * Gera JSON
     */
    this.context['JSON'] = ebfCreateObjectJSON.call(this, this.context['ResultMaker']);

    /**
     * Obtém GUID
     */
    this.context['GUID'] = ebfGetValueObjectJson.call(this, this.context['JSON'], 'guid');

    return this.FlowSubRoutine5();

  }

}

IntegracaoConfiguracoesSalvar.prototype.FlowSubRoutine1 = function() {

    /**
     * Integracao - Configuracoes - Cria JSON
     */
    this.context['ResultMaker'] = executeSyncJavaRule.call(this, this.getSystem(), this.getForm(), 'Integracao - Configuracoes - Cria JSON', [this.context['Bibliotecas_URL'], ebfGetValueObjectJson.call(this, this.context['JSON Retorno'], 'html'), ebfGetValueObjectJson.call(this, this.context['JSON Retorno'], 'javascript'), this.context['Lista de Eventos'], ebfGetValueObjectJson.call(this, this.context['JSON Retorno'], 'css'), this.context['GUID']]);

    /**
     * Insere em result_maker
     */
    ebfSetLocalVariable.call(this, 'result_maker', this.context['ResultMaker']);

    /**
     * Fim
     */
    return null;
  }

IntegracaoConfiguracoesSalvar.prototype.FlowExpression7 = function() {

    /**
     * Obtém tamanho da grade
     */
    this.context['Tamanho da grade'] = ebfGridRowCount.call(this, 'MakerGrid2');

    /**
     * grade não possui registros
     */
    if (parseBoolean(isMinorOrEqual.call(this, this.context['Tamanho da grade'], parseInt(0)))) {
        
      return this.FlowSubRoutine1();

    } else {

      /**
       * Contador é maior que a grade
       */
      while (parseBoolean(oprNot.call(this, isGreater.call(this, this.context['contador'], this.context['Tamanho da grade'])))) {

        /**
         * Obtém Id do elemento
         */
        this.context['Id do elemento'] = ebfGridGetValue.call(this, 'MakerGrid2', oprSubtract.call(this, this.context['contador'], parseInt(1)), 'Elemento');

        /**
         * Obtém evento DOM
         */
        this.context['Evento DOM'] = ebfGridGetValue.call(this, 'MakerGrid2', oprSubtract.call(this, this.context['contador'], parseInt(1)), 'Ação');

        /**
         * Obtém nome do fluxo
         */
        this.context['Fluxo maker'] = ebfGridGetValue.call(this, 'MakerGrid2', oprSubtract.call(this, this.context['contador'], parseInt(1)), 'Fluxo a ser executado');

        /**
         * Obtém lista de parâmetros
         */
        this.context['Lista de Parametros'] = ebfGridGetValue.call(this, 'MakerGrid2', oprSubtract.call(this, this.context['contador'], parseInt(1)), 'Parâmetros');

        /**
         * Insere na lista de eventos
         */
        this.context['Lista de Eventos'] = ebfConcat.call(this, this.context['Lista de Eventos'], this.context['Id do elemento'], '$', this.context['Evento DOM'], '$', this.context['Fluxo maker'], '$', this.context['Lista de Parametros'], ',');

        /**
         * Incrementa contador
         */
        this.context['contador'] = oprAdd.call(this, this.context['contador'], parseInt(1));
      }

      return this.FlowSubRoutine1();

    }
  }

IntegracaoConfiguracoesSalvar.prototype.FlowSubRoutine5 = function() {

    /**
     * Integracao - Salvar - Obter Valores do Editor
     */
    this.context['JSON Retorno'] = new IntegracaoSalvarObterValoresDoEditor(this, this.getSystem(), this.getForm()).run();

    /**
     * Integracao - Configuracoes - Carregar lista de elementos
     */
    new IntegracaoConfiguracoesCarregarListaDeElementos(this, this.getSystem(), this.getForm()).run(ebfGetValueObjectJson.call(this, this.context['JSON Retorno'], 'html'));

    /**
     * Obter tamanho da grade
     */
    this.context['Tamanho da grade'] = ebfGridRowCount.call(this, 'MakerGrid1');

    /**
     * Não há registros
     */
    if (parseBoolean(isMinorOrEqual.call(this, this.context['Tamanho da grade'], parseInt(0)))) {
        
      return this.FlowExpression7();

    } else {

      /**
       * Contador é maior que o tamanho da lista
       */
      while (parseBoolean(oprNot.call(this, isGreater.call(this, this.context['contador'], this.context['Tamanho da grade'])))) {

        /**
         * Obter valor na linha
         */
        this.context['Endereço da linha'] = ebfGridGetValue.call(this, 'MakerGrid1', oprSubtract.call(this, this.context['contador'], parseInt(1)), 'Biblioteca');

        /**
         * Concatena na lista de endereços
         */
        this.context['Bibliotecas_URL'] = ebfConcat.call(this, this.context['Bibliotecas_URL'], this.context['Endereço da linha'], '|');

        /**
         * Incrementa contador
         */
        this.context['contador'] = oprAdd.call(this, this.context['contador'], parseInt(1));
      }

      /**
       * Reseta contador
       */
      this.context['contador'] = parseInt(1);

      return this.FlowExpression7();

    }
  }


function runIntegracaoConfiguracoesSalvar(parent, sys, formID, params) {
  var rule = new IntegracaoConfiguracoesSalvar(parent, sys, formID);
  rule.run.apply(rule, params);
}

