/**
 * Esta função executa a regra "Integracao - Salvar - Obter Valores do Editor"
 * @author master
 * @since 15/05/2017 15:06:34
 */
IntegracaoSalvarObterValoresDoEditor.prototype.run = function() {
  document.ruleNameForException = 'Integracao - Salvar - Obter Valores do Editor';
  this.context = new Array();

  // Variáveis
  this.context['CodeMirror'] = null;

  this.context['HTML'] = '';

  this.context['JavaScript'] = '';

  this.context['CSS'] = '';

  this.context['JSON Retorno'] = null;


  /**
   * Obtém editor HTML
   */
  this.context['CodeMirror'] = ebfHtmlGetElementById.call(this, 'MakerMemo1');

  /**
   * Editor já foi inicializado?
   */
  if (parseBoolean(isGreater.call(this, ebfListLength.call(this, ebfHtmlChildNodes.call(this, this.context['CodeMirror'])), parseInt(0)))) {
      
    /**
     * Obtém valor
     */
    this.context['HTML'] = ebfExecuteJS.call(this, 'return document.getElementById(\"MakerMemo1\").childNodes[0].CodeMirror.getValue();');

    return this.FlowExpression3();

  } else {

    return this.FlowExpression3();

  }

}

