        ebfHtmlSetAttribute.call(this, this.context['Componente Maker'], 'class', ebfConcat.call(this, 'HTMLLabel ', 'HTMLListagem', ebfReplaceAll.call(this, this.context['Propriedade'], ' ', '')));

