ListagemExcluirVersao.prototype = new Rule;

/**
 * Esta função executa a regra "Listagem - Excluir versão"
 * @param Componente Versão equivale à variável this.context['Componente Versão']<br/>
 * @param Codigo do Componente equivale à variável this.context['Codigo do Componente']<br/>
 * @param Nome Listagem equivale à variável this.context['Nome Listagem']<br/>
 * @param Componente Maker equivale à variável this.context['Componente Maker']<br/>
 * @param Salvar em Banco equivale à variável this.context['Salvar em Banco']<br/>
 * @author master
 * @since 26/08/2019 13:47:43
 */
ListagemExcluirVersao.prototype.run = function() {
  document.ruleNameForException = 'Listagem - Excluir versão';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Componente Versão'] = this.checkType(arguments[0], 'Letras');

  this.context['Codigo do Componente'] = this.checkType(arguments[1], 'Letras');

  this.context['Nome Listagem'] = this.checkType(arguments[2], 'Letras');

  this.context['Componente Maker'] = this.checkType(arguments[3], 'Letras');

  this.context['Salvar em Banco'] = this.checkType(arguments[4], 'Letras');

  // Variáveis
  this.context['Lista de Retorno'] = null;

  this.context['json'] = null;

  this.context['Texto Json'] = '';

  this.context['Nome da Versão'] = '';

  this.context['Json Versão'] = null;

  this.context['Usuario'] = '';


  /**
   * Obter Nome da Versão
   */
  this.context['Nome da Versão'] = ebfFormGetComponentValue.call(this, ebfGetGUIDActualForm.call(this), this.context['Componente Versão']);

  /**
   * Inexistente?
   */
  if (parseBoolean(isNullOrEmpty.call(this, this.context['Nome da Versão']))) {
      
    return this.FlowEnd2();

  } else {

    /**
     * Excluir?
     */
    if (parseBoolean(ebfConfirm.call(this, ebfConcat.call(this, 'Deseja realmente excluir a Listagem \"', this.context['Nome da Versão'], '\"?')))) {
        
      /**
       * Listagem - Lista de Versões Relatório
       */
      this.context['Lista de Retorno'] = executeSyncJavaRule.call(this, this.getSystem(), this.getForm(), 'Listagem - Lista de Versões Relatório', [this.context['Codigo do Componente'], this.context['Nome da Versão'], this.context['Componente Maker'], 'False', this.context['Salvar em Banco']]);

      /**
       * Texto Json
       */
      this.context['Texto Json'] = ebfMapGetObject.call(this, this.context['Lista de Retorno'], 'TextoArquivo');

      /**
       * Json
       */
      this.context['json'] = ebfCreateObjectJSON.call(this, this.context['Texto Json']);

      /**
       * Json versão
       */
      this.context['Json Versão'] = ebfGetValueObjectJson.call(this, this.context['json'], this.context['Nome da Versão']);

      /**
       * ADM?
       */
      if (parseBoolean(toBoolean.call(this, ebfGetComponentProperty.call(this, ebfGetGUIDActualForm.call(this), this.context['Componente Maker'], 'ADM')))) {
          
        return this.FlowConnector2();

      } else {

        /**
         * Usuário
         */
        this.context['Usuario'] = ebfGetValueObjectJson.call(this, this.context['Json Versão'], 'usuario');

        /**
         * Mesmo Usuário?
         */
        if (parseBoolean(isEqual.call(this, ebfToUpperCase.call(this, (isNull.call(this, this.context['Usuario']) ? '' : this.context['Usuario'])), ebfToUpperCase.call(this, ebfGetComponentProperty.call(this, ebfGetGUIDActualForm.call(this), this.context['Componente Maker'], 'Login'))))) {
            
          return this.FlowConnector2();

        } else {

          /**
           * Mensagem de Alerta
           */
          ActWarningMessage(ebfConcat.call(this, 'A listagem só pode ser excluida pelo criador \"', this.context['Usuario'], '\"!'));

          return this.FlowConnector3();

        }

      }

    } else {

      return this.FlowConnector3();

    }

  }

}

ListagemExcluirVersao.prototype.FlowConnector2 = function() {

    /**
     * Listagem - Excluir Arquivo
     */
    executeSyncJavaRule.call(this, this.getSystem(), this.getForm(), 'Listagem - Excluir Arquivo', [this.context['Codigo do Componente'], this.context['Nome da Versão'], this.context['Componente Maker']]);

    /**
     * Remover Elemento da Lista
     */
    ebfExecuteCustomJSFunction.call(this, ebfFormComponentByName.call(this, this.context['Componente Versão']), 'removeByKey', ebfListParamsCreate.call(this, this.context['Nome da Versão']));

    /**
     * Limpar Componente
     */
    ebfFormChangeComponentValue.call(this, ebfGetGUIDActualForm.call(this), this.context['Componente Versão'], null);

    return this.FlowEnd2();
  }

ListagemExcluirVersao.prototype.FlowConnector3 = function() {

    return this.FlowEnd2();
  }

