ListagemListaDeMascaraDeAcordoComOTipo.prototype = new Rule;

/**
 * Esta função executa a regra "Listagem - Lista de Mascara de Acordo com o Tipo"
 * @param tipododado equivale à variável this.context['tipododado']<br/>
 * @param propriedade equivale à variável this.context['propriedade']<br/>
 * @param componente Principal equivale à variável this.context['componente Principal']<br/>
 * @author master
 * @since 02/08/2017 21:55:20
 */
ListagemListaDeMascaraDeAcordoComOTipo.prototype.run = function() {
  document.ruleNameForException = 'Listagem - Lista de Mascara de Acordo com o Tipo';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['tipododado'] = this.checkType(arguments[0], 'Letras');

  this.context['propriedade'] = this.checkType(arguments[1], 'Letras');

  this.context['componente Principal'] = this.checkType(arguments[2], 'Letras');

  // Variáveis
  this.context['Lista de Valores'] = null;

  this.context['Lista de chaves'] = null;


  /**
   * Mascara?
   */
  if (parseBoolean(isEqual.call(this, ebfToUpperCase.call(this, this.context['propriedade']), 'MASCARA'))) {
      
    /**
     * Data?
     */
    if (parseBoolean(ebfSearchSubstring.call(this, ebfToUpperCase.call(this, this.context['tipododado']), 'DATA'))) {
        
      /**
       * Lista de Chaves
       */
      this.context['Lista de chaves'] = ebfListParamsCreate.call(this, 'dd/MM/yyyy HH:mm:ss', 'dd/MM/yyyy', 'yyyyMMdd');

      /**
       * Definir Propriedade Mascaralistas
       */
      this.context['Lista de Valores'] = ebfListParamsCreate.call(this, 'Data com Hora', 'Data', 'AnoMêsDia');

      return this.FlowEnd1();

    } else {

      /**
       * Valor?
       */
      if (parseBoolean(ebfSearchSubstring.call(this, ebfToUpperCase.call(this, this.context['tipododado']), 'MOEDA'))) {
          
        /**
         * Lista de Chaves
         */
        this.context['Lista de chaves'] = ebfListParamsCreate.call(this, '#,##0.00#', 'R$ #,##0.00#', '0esq', '0esqVirg');

        /**
         * Definir Propriedade Mascaralistas
         */
        this.context['Lista de Valores'] = ebfListParamsCreate.call(this, 'Valor', 'Valor R$', '0 à Esquerda', '0 à Esquerda com Virgula');

        return this.FlowConnector2();

      } else {

        /**
         * Lista de Chaves
         */
        this.context['Lista de chaves'] = ebfListParamsCreate.call(this, '##.###.###/####-##', '###.###.###-##', '##.###-###', '!\\(00\\)\\ !0000\\-0000;0;');

        /**
         * Definir Propriedade Mascaralistas
         */
        this.context['Lista de Valores'] = ebfListParamsCreate.call(this, 'CNPJ', 'CPF', 'CEP', 'Telefone');

        return this.FlowConnector2();

      }

    }

  } else {

    /**
     * Lista de Chaves
     */
    this.context['Lista de chaves'] = ebfGetLocalVariable.call(this, ebfConcat.call(this, this.context['componente Principal'], ebfConcat.call(this, ebfReplaceAll.call(this, this.context['propriedade'], ' ', ''), 'valoreschaves')));

    /**
     * Lista de Valores
     */
    this.context['Lista de Valores'] = ebfGetLocalVariable.call(this, ebfConcat.call(this, this.context['componente Principal'], ebfConcat.call(this, ebfReplaceAll.call(this, this.context['propriedade'], ' ', ''), 'valoreslista')));

    return this.FlowEnd1();

  }

}

ListagemListaDeMascaraDeAcordoComOTipo.prototype.FlowConnector2 = function() {

    return this.FlowEnd1();
  }

ListagemListaDeMascaraDeAcordoComOTipo.prototype.FlowEnd1 = function() {

    /**
     * Fim
     */
    return ebfListParamsCreate.call(this, this.context['Lista de chaves'], this.context['Lista de Valores']);
  }


