function ListagemMarcarTodosParaExbicao(parent, sys, formID) {
  this.ruleName = 'Listagem - Marcar Todos para Exbicao';
  this.functionName = 'ListagemMarcarTodosParaExbicao';
  this.parent = parent;
  this.sys = sys;
  this.formID = formID;
  this.translations = new Map();
}

ListagemMarcarTodosParaExbicao.prototype = new Rule;

/**
 * Esta função executa a regra "Listagem - Marcar Todos para Exbicao"
 * @param Componente Todos equivale à variável this.context['Componente Todos']<br/>
 * @param Div dos campos equivale à variável this.context['Div dos campos']<br/>
 * @param Codigo equivale à variável this.context['Codigo']<br/>
 * @author master
 * @since 21/02/2022 10:25:07
 */
ListagemMarcarTodosParaExbicao.prototype.run = function() {
  document.ruleNameForException = 'Listagem - Marcar Todos para Exbicao';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Componente Todos'] = this.checkType(arguments[0], 'Letras');

  this.context['Div dos campos'] = this.checkType(arguments[1], 'Letras');

  this.context['Codigo'] = this.checkType(arguments[2], 'Letras');

  // Variáveis
  this.context['Lista de Filhos'] = null;

  this.context['Tamanho'] = 0;

  this.context['Contador'] = 0;

  this.context['Valor'] = '';

  this.context['Objeto'] = null;

  this.context['id'] = '';

  this.context['nome componente'] = '';

  this.context['Contador'] = parseInt(1);

  /**
   * Valor
   */
  this.context['Valor'] = ebfFormGetComponentValue.call(this, ebfGetGUIDActualForm.call(this), this.context['Componente Todos']);

  /**
   * Valida Valor Nulo
   */
  this.context['Valor'] = (isNullOrEmpty.call(this, this.context['Valor']) ? 'S' : this.context['Valor']);

  /**
   * Filhos da Div
   */
  this.context['Lista de Filhos'] = ebfHtmlChildNodes.call(this, ebfHtmlGetMakerElementById.call(this, this.context['Div dos campos']));

  /**
   * Tamanho
   */
  this.context['Tamanho'] = ebfListLength.call(this, this.context['Lista de Filhos']);

  /**
   * Existe Componentes
   */
  while (parseBoolean(isGreaterOrEqual.call(this, this.context['Tamanho'], this.context['Contador']))) {

    /**
     * Objeto
     */
    this.context['Objeto'] = ebfGetElementFromList.call(this, this.context['Lista de Filhos'], this.context['Contador']);

    /**
     * id da linha
     */
    this.context['id'] = ebfHtmlGetAttribute.call(this, this.context['Objeto'], 'id');

    /**
     * Formata nome do campo
     */
    this.context['nome componente'] = ebfGetElementFromList.call(this, ebfSplit.call(this, this.context['id'], 'linha_'), parseInt(2));

    /**
     * Definie Nome do Componente
     */
    this.context['nome componente'] = ebfConcat.call(this, this.context['nome componente'], this.context['Codigo'], 'WFRlistagemmakerMostrar');

    /**
     * Alterar Valor do Componente
     */
    ebfFormChangeComponentValue.call(this, ebfGetGUIDActualForm.call(this), this.context['nome componente'], this.context['Valor']);

    /**
     * Cont++
     */
    this.context['Contador'] = oprAdd.call(this, this.context['Contador'], parseFloat(1));
  }

  /**
   * Fim
   */
  return null;

}

function runListagemMarcarTodosParaExbicao(parent, sys, formID, params) {
  var rule = new ListagemMarcarTodosParaExbicao(parent, sys, formID);
  rule.run.apply(rule, params);
}

