function ListagemMontarGrupoDoCampo(parent, sys, formID) {
  this.ruleName = 'Listagem - Montar Grupo do Campo';
  this.functionName = 'ListagemMontarGrupoDoCampo';
  this.parent = parent;
  this.sys = sys;
  this.formID = formID;
  this.translations = new Map();
}

ListagemMontarGrupoDoCampo.prototype = new Rule;

/**
 * Esta função executa a regra "Listagem - Montar Grupo do Campo"
 * @param Campo equivale à variável this.context['Campo']<br/>
 * @param Nome do Componente equivale à variável this.context['Nome do Componente']<br/>
 * @param Componente Maker equivale à variável this.context['Componente Maker']<br/>
 * @param Código Componente equivale à variável this.context['Código Componente']<br/>
 * @author Bruno Brasil
 * @since 07/06/2018 20:24:20
 */
ListagemMontarGrupoDoCampo.prototype.run = function() {
  document.ruleNameForException = 'Listagem - Montar Grupo do Campo';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Campo'] = this.checkType(arguments[0], 'Letras');

  this.context['Nome do Componente'] = this.checkType(arguments[1], 'Letras');

  this.context['Componente Maker'] = this.checkType(arguments[2], 'Letras');

  this.context['Código Componente'] = this.checkType(arguments[3], 'Inteiro');

  // Variáveis
  this.context['Grupos'] = null;

  this.context['Remover?'] = false;

  this.context['Posição'] = 0;

  this.context['Ordem Novo Grupo'] = 0;

  this.context['Valor do Componente'] = '';

  this.context['Componente Ordem'] = '';

  this.context['Ordem anterior'] = '';


  /**
   * Obtem Grupo
   */
  this.context['Grupos'] = ebfGetComponentProperty.call(this, ebfGetGUIDActualForm.call(this), this.context['Componente Maker'], 'grupos');

  /**
   * Componente Ordem
   */
  this.context['Componente Ordem'] = ebfReplace.call(this, this.context['Nome do Componente'], 'Agrupar', 'Ordem');

  /**
   * Ordem anterior
   */
  this.context['Ordem anterior'] = ebfFormGetComponentValue.call(this, null, this.context['Componente Ordem']);

  /**
   * Valor do Componente
   */
  this.context['Valor do Componente'] = ebfFormGetComponentValue.call(this, ebfGetGUIDActualForm.call(this), this.context['Nome do Componente']);

  /**
   * Posição
   */
  this.context['Posição'] = ebfFormGetComponentValue.call(this, ebfGetGUIDActualForm.call(this), ebfReplace.call(this, this.context['Nome do Componente'], 'Agrupar', 'Ordem'));

  /**
   * Remover
   */
  this.context['Remover?'] = (isEqual.call(this, ebfToUpperCase.call(this, this.context['Valor do Componente']), 'N') || isNullOrEmpty.call(this, this.context['Valor do Componente']));

  /**
   * Grupo Vazio?
   */
  if (parseBoolean(isNullOrEmpty.call(this, this.context['Grupos']))) {
      
    /**
     * Json Grupos
     */
    this.context['Grupos'] = ebfCreateObjectJSON.call(this, ebfConcat.call(this, '{\"', this.context['Campo'], '\":\"', this.context['Posição'], '\"}'));

    return this.FlowConnector1();

  } else {

    /**
     * Nova Ordem
     */
    this.context['Ordem Novo Grupo'] = oprAdd.call(this, ebfListLength.call(this, ebfGetListKeysObjectJson.call(this, this.context['Grupos'])), parseFloat(1));

    /**
     * Remover?
     */
    if (parseBoolean(this.context['Remover?'])) {
        
      /**
       * Remover campo do Json
       */
      ebfDeleteObject.call(this, this.context['Grupos'], this.context['Campo']);

      /**
       * Limpar Ordem?
       */
      ebfFormChangeComponentValue.call(this, ebfGetGUIDActualForm.call(this), this.context['Componente Ordem'], '');

      /**
       * Listagem - Ordenar ao selecionar
       */
      new ListagemOrdenarAoSelecionar(this, this.getSystem(), this.getForm()).run(this.context['Código Componente'], this.context['Campo'], this.context['Ordem anterior'], 'true', null);

      return this.FlowSubRoutine5();

    } else {

      /**
       * Atualiza Ordem
       */
      ebfFormChangeComponentValue.call(this, null, this.context['Componente Ordem'], this.context['Ordem Novo Grupo']);

      /**
       * Atualizar Campo
       */
      this.context['Grupos'] = ebfUpdateValueObjectJson.call(this, this.context['Grupos'], this.context['Campo'], this.context['Posição']);

      return this.FlowConnector1();

    }

  }

}

ListagemMontarGrupoDoCampo.prototype.FlowConnector1 = function() {

    return this.FlowSubRoutine5();
  }

ListagemMontarGrupoDoCampo.prototype.FlowSubRoutine5 = function() {

    /**
     * Listagem - Obter Mapa de Grupos
     */
    this.context['Grupos'] = new ListagemObterMapaDeGrupos(this, this.getSystem(), this.getForm()).run(this.context['Grupos'], this.context['Código Componente'], this.context['Componente Maker']);

    /**
     * Fim
     */
    return null;
  }


