function ListagemOrdenarLista(parent, sys, formID) {
  this.ruleName = 'Listagem - Ordenar Lista';
  this.functionName = 'ListagemOrdenarLista';
  this.parent = parent;
  this.sys = sys;
  this.formID = formID;
  this.translations = new Map();
}

ListagemOrdenarLista.prototype = new Rule;

/**
 * Esta função executa a regra "Listagem - Ordenar Lista"
 * @param json equivale à variável this.context['json']<br/>
 * @param campo equivale à variável this.context['campo']<br/>
 * @param ordem equivale à variável this.context['ordem']<br/>
 * @author Bruno Brasil
 * @since 07/06/2018 20:24:08
 */
ListagemOrdenarLista.prototype.run = function() {
  document.ruleNameForException = 'Listagem - Ordenar Lista';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['json'] = this.checkType(arguments[0], 'Variante');

  this.context['campo'] = this.checkType(arguments[1], 'Letras');

  this.context['ordem'] = this.checkType(arguments[2], 'Letras');

  // Variáveis
  this.context['Lista'] = null;

  this.context['tamanho'] = 0;

  this.context['contador'] = 0;

  this.context['componente'] = '';

  this.context['chave'] = '';

  this.context['swaped'] = false;

  this.context['posição da lista'] = '';

  this.context['posicao mais 1'] = '';

  this.context['contador'] = parseInt(1);
  this.context['swaped'] = true;

  /**
   * Lista de Chaves
   */
  this.context['Lista'] = ebfGetListKeysObjectJson.call(this, this.context['json']);

  /**
   * Ordenar Chaves
   */
  this.context['Lista'] = ebfListSort.call(this, this.context['Lista'], true);

  /**
   * Tamanho
   */
  this.context['tamanho'] = ebfListLength.call(this, this.context['Lista']);

  /**
   * swaped
   */
  while (parseBoolean(this.context['swaped'])) {

    /**
     * swaped = false
     */
    this.context['swaped'] = false;

    /**
     * Contador < Tamanho da Lista
     */
    while (parseBoolean(isMinor.call(this, this.context['contador'], this.context['tamanho']))) {

      /**
       * Posição da Lista
       */
      this.context['posição da lista'] = ebfGetElementFromList.call(this, this.context['Lista'], this.context['contador']);

      /**
       * Posição + 1
       */
      this.context['posicao mais 1'] = ebfGetElementFromList.call(this, this.context['Lista'], oprAdd.call(this, this.context['contador'], parseFloat(1)));

      /**
       * Posição Maior?
       */
      if (parseBoolean(isGreater.call(this, this.context['posição da lista'], this.context['posicao mais 1']))) {
          
        /**
         * swaped = true
         */
        this.context['swaped'] = true;

        /**
         * Substituir Elemento na Lista
         */
        this.context['Lista'] = ebfReplaceElementFromList.call(this, this.context['Lista'], this.context['posição da lista'], oprAdd.call(this, this.context['contador'], parseFloat(1)));

        /**
         * Substituir Próximo elemento
         */
        this.context['Lista'] = ebfReplaceElementFromList.call(this, this.context['Lista'], this.context['posicao mais 1'], this.context['contador']);

        var FlowExpression14 = this.FlowExpression14();
        if (!(FlowExpression14 instanceof InvalidVariant)) {
          return FlowExpression14;
        }

      } else {

        var FlowExpression14 = this.FlowExpression14();
        if (!(FlowExpression14 instanceof InvalidVariant)) {
          return FlowExpression14;
        }

      }
    }

    /**
     * Cont = 1
     */
    this.context['contador'] = parseInt(1);
  }

  /**
   * Existe Chave?
   */
  while (parseBoolean(isGreaterOrEqual.call(this, this.context['tamanho'], this.context['contador']))) {

    /**
     * Obtem Chave
     */
    this.context['chave'] = ebfGetElementFromList.call(this, this.context['Lista'], this.context['contador']);

    /**
     * Nome do Componente
     */
    this.context['componente'] = ebfGetValueObjectJson.call(this, this.context['json'], this.context['chave']);

    /**
     * Alterar Valor
     */
    ebfFormChangeComponentValue.call(this, ebfGetGUIDActualForm.call(this), this.context['componente'], this.context['contador']);

    /**
     * Cont++
     */
    this.context['contador'] = oprAdd.call(this, this.context['contador'], parseFloat(1));
  }

  /**
   * Fim
   */
  return null;

}

ListagemOrdenarLista.prototype.FlowExpression14 = function() {

    /**
     * Cont++
     */
    this.context['contador'] = oprAdd.call(this, this.context['contador'], parseFloat(1));

    return new InvalidVariant();
  }


