  ebfFormChangeComponentValue.call(this, ebfGetGUIDActualForm.call(this), 'nometemplate', ebfConcat.call(this, 'Template : ', this.context['Nome do Arquivo']));

  /**
   * Caminho do arquivo
   */
  ebfFormChangeComponentValue.call(this, ebfGetGUIDActualForm.call(this), 'caminho', this.context['Caminho do Arquivo']);

  /**
   * Listagem - Template - Ler Arquivo
   */
  this.context['Retorno'] = executeSyncJavaRule.call(this, this.getSystem(), this.getForm(), 'Listagem - Template - Ler Arquivo', [this.context['Caminho do Arquivo']]);

  /**
   * Campo XML
   */
  ebfFormChangeComponentValue.call(this, ebfGetGUIDActualForm.call(this), 'xmltemplate', ebfGetElementFromList.call(this, this.context['Retorno'], parseInt(1)));

  /**
   * Atualizar conteúdo json
   */
  this.context['Json'] = ebfUpdateValueObjectJson.call(this, this.context['Json'], 'xml', ebfGetElementFromList.call(this, this.context['Retorno'], parseInt(2)));

