  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Json'] = this.checkType(arguments[0], 'Variante');

  this.context['Nome Versão'] = this.checkType(arguments[1], 'Letras');

  this.context['Salvar em Banco'] = this.checkType(arguments[2], 'Letras');

  this.context['Componente Maker'] = this.checkType(arguments[3], 'Letras');

  // Variáveis
