/**
 * Verifica na Lista de CSS passada como parâmetro, se o CSS também passado como parâmetro já foi gerado.<br/>
 * Retorno: True (Já existe CSS) / False (Não existe CSS na lista)
 */
function EditorDeLayoutMagicExisteCssNaLista(parent, sys, formID) {
  this.ruleName = 'Editor de Layout - Magic - Existe CSS na Lista';
  this.functionName = 'EditorDeLayoutMagicExisteCssNaLista';
  this.parent = parent;
  this.sys = sys;
  this.formID = formID;
  this.translations = new Map();
}

EditorDeLayoutMagicExisteCssNaLista.prototype = new Rule;

/**
 * Esta função executa a regra "Editor de Layout - Magic - Existe CSS na Lista"
 * @author caio
 * @since 02/06/2016 21:48:22
 */
EditorDeLayoutMagicExisteCssNaLista.prototype.run = function() {
  document.ruleNameForException = 'Editor de Layout - Magic - Existe CSS na Lista';
  this.context = new Array();

  // Variáveis
  this.context['CSS'] = '';

  this.context['Lista de CSS'] = null;

  this.context['Contador'] = 0;

  this.context['Contador'] = parseInt(1);

  /**
   * Obter CSS gerado
   */
  this.context['CSS'] = ebfFormGetComponentValue.call(this, ebfGetGUIDActualForm.call(this), 'textoCSS');

  /**
   * Obter lista de CSS
   */
  this.context['Lista de CSS'] = ebfGetLocalVariable.call(this, 'listaCSS');

  /**
   * Contador <= Tamanho da Lista de CSS ?
   */
  while (parseBoolean(isMinorOrEqual.call(this, this.context['Contador'], ebfListLength.call(this, this.context['Lista de CSS'])))) {

    /**
     * CSS Gerado == CSS da Lista?
     */
    if (parseBoolean(isEqual.call(this, this.context['CSS'], ebfGetElementFromList.call(this, this.context['Lista de CSS'], this.context['Contador'])))) {
        
      /**
       * Fim
       */
      return true;

    } else {

      /**
       * Contador ++
       */
      this.context['Contador'] = oprAdd.call(this, this.context['Contador'], parseFloat(1));

    }
  }

  /**
   * Fim
   */
  return false;

}

function runEditorDeLayoutMagicExisteCssNaLista(parent, sys, formID, params) {
  var rule = new EditorDeLayoutMagicExisteCssNaLista(parent, sys, formID);
  rule.run.apply(rule, params);
}

