/**
 * Esta função executa a regra "Tabela -  Interface - Exibir Parâmetros Fluxo"
 * @param Código equivale à variável this.context['Código']<br/>
 * @author master
 * @since 31/08/2016 14:49:15
 */
TabelaInterfaceExibirParametrosFluxo.prototype.run = function() {
  document.ruleNameForException = 'Tabela -  Interface - Exibir Parâmetros Fluxo';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Código'] = this.checkType(arguments[0], 'Letras');

  // Variáveis
  this.context['Parâmetros'] = '';

  this.context['Contador'] = 0;

  this.context['Lista de Parâmetros'] = null;

  this.context['Posição Y'] = 0;

  this.context['Prefixo'] = '';

  this.context['Nome'] = '';

  this.context['Contador'] = parseInt(1);
  this.context['Posição Y'] = parseInt(20);

  /**
   * Tabela -  Interface - Limpar Parâmetros Fluxo
   */
  new TabelaInterfaceLimparParametrosFluxo(this, this.getSystem(), this.getForm()).run();

  /**
   * Selecionou fluxo?
   */
  if (parseBoolean(oprNot.call(this, isNullOrEmpty.call(this, this.context['Código'])))) {
      
    /**
     * Tabela - Interface - Obter Parâmetros Fluxo
     */
    this.context['Parâmetros'] = executeSyncJavaRule.call(this, this.getSystem(), this.getForm(), 'Tabela - Interface - Obter Parâmetros Fluxo', [this.context['Código']]);

    /**
     * Parâmetros é nulo ?
     */
    if (parseBoolean(isNullOrEmpty.call(this, this.context['Parâmetros']))) {
        
      /**
       * Fim
       */
      return null;

    } else {

      /**
       * Obter lista de parâmetros !
       */
      this.context['Lista de Parâmetros'] = ebfSplit.call(this, this.context['Parâmetros'], ';');

      /**
       * Definir scroll da moldura !
       */
      ebfHtmlCssDefineStyle.call(this, ebfHtmlGetMakerElementById.call(this, 'MakerBevel9'), 'overflowY', 'auto');

      /**
       * Definir prefixo !
       */
      this.context['Prefixo'] = ebfRandom.call(this, parseInt(99999999));

      /**
       * Tem parâmetros?
       */
      while (parseBoolean(isMinorOrEqual.call(this, this.context['Contador'], ebfListLength.call(this, this.context['Lista de Parâmetros'])))) {

        /**
         * Obtém o nome do componente
         */
        this.context['Nome'] = ebfGetElementFromList.call(this, ebfSplit.call(this, ebfGetElementFromList.call(this, this.context['Lista de Parâmetros'], this.context['Contador']), ','), parseInt(1));

        /**
         * Adicionar componente na tela !
         */
        ebfEditNew.call(this, ebfGetSelectTabStringName.call(this), parseInt(8), this.context['Posição Y'], parseInt(300), parseInt(21), this.context['Nome'], null, this.context['Nome'], null, null, null, null);

        /**
         * Cria um combo para seleção do tipo do parâmetro
         */
        ebfComboBoxNew.call(this, ebfGetSelectTabStringName.call(this), parseInt(310), this.context['Posição Y'], parseInt(85), parseInt(21), '', ebfListParamsCreate.call(this, '1', '2', '3', '4'), ebfListParamsCreate.call(this, 'Campo', 'Componente', 'Constante', 'Formulário'), ebfConcat.call(this, this.context['Nome'], 'combo'));

        /**
         * Associa o atributo da caixa de texto relacionada ao combo para uso posterior
         */
        ebfHtmlSetAttribute.call(this, ebfHtmlGetMakerElementById.call(this, ebfConcat.call(this, this.context['Nome'], 'combo')), 'innerComp', this.context['Nome']);

        /**
         * Associa o evento ao combo
         */
        ebfComponentEventAssociate.call(this, ebfConcat.call(this, this.context['Nome'], 'combo'), 'onchange', 'Tabela -  Interface - Parâmetro ao Modificar', ebfListParamsCreate.call(this, ebfConcat.call(this, this.context['Nome'], 'combo')));

        /**
         * Associar componente a moldura !
         */
        ebfHtmlAppendElementAt.call(this, ebfHtmlGetMakerElementById.call(this, 'MakerBevel9'), ebfHtmlGetMakerElementById.call(this, this.context['Nome']));

        /**
         * Associar o combo a moldura !
         */
        ebfHtmlAppendElementAt.call(this, ebfHtmlGetMakerElementById.call(this, 'MakerBevel9'), ebfHtmlGetMakerElementById.call(this, ebfConcat.call(this, this.context['Nome'], 'combo')));

        /**
         * Incrementar contador !
         */
        this.context['Contador'] = oprAdd.call(this, this.context['Contador'], parseInt(1));

        /**
         * Incrementar Posição Y !
         */
        this.context['Posição Y'] = oprAdd.call(this, this.context['Posição Y'], parseInt(40));
      }

      /**
       * Fim
       */
      return null;

    }

  } else {
    return null;

  }

}

