TabelaAbrirFormulario.prototype = new Rule;

/**
 * Esta função executa a regra "Tabela - Abrir Formulário"
 * @param Referencia do Evento equivale à variável this.context['Referencia do Evento']<br/>
 * @param GUID equivale à variável this.context['GUID']<br/>
 * @param Nome equivale à variável this.context['Nome']<br/>
 * @author masters
 * @since 14/06/2017 10:19:31
 */
TabelaAbrirFormulario.prototype.run = function() {
  document.ruleNameForException = 'Tabela - Abrir Formulário';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Referencia do Evento'] = this.checkType(arguments[0], 'Variante');

  this.context['GUID'] = this.checkType(arguments[1], 'Letras');

  this.context['Nome'] = this.checkType(arguments[2], 'Letras');

  // Variáveis
  this.context['Linhas'] = null;

  this.context['Campo Chave'] = '';

  this.context['Valor'] = null;

  this.context['Tipo do Campo'] = '';

  this.context['Paramêtros da Consulta'] = null;

  this.context['Contador'] = 0;

  this.context['Linha'] = 0;

  this.context['Nome da Coluna'] = '';

  this.context['Contador'] = parseInt(1);

  /**
   * Executar PreventDefault.
   */
  ebfExecuteCustomJSFunction.call(this, this.context['Referencia do Evento'], 'preventDefault', ebfListParamsCreate.call(this, null));

  /**
   * Formulário associado é nulo ou vazio?
   */
  if (parseBoolean(isNullOrEmpty.call(this, ebfGetClientFormVariable.call(this, ebfConcat.call(this, this.context['Nome'], '_formulario'))))) {
      
    /**
     * Mensagem de Alerta
     */
    ActNewWarningMessage(null, 'Não existe formulário associado para edição do registro!', parseInt(1), null);

    /**
     * Fim
     */
    return null;

  } else {

    /**
     * Criar objeto lista
     */
    this.context['Valor'] = ebfListCreate.call(this);

    /**
     * Obter Linha Selecionada
     */
    this.context['Linhas'] =     new TabelaObterLinhasSelecionadas(this, this.getSystem(), this.getForm()).run(this.context['Nome']);


    /**
     * Obter valor do componente
     */
    while (parseBoolean(isMinorOrEqual.call(this, this.context['Contador'], ebfListLength.call(this, this.context['Linhas'])))) {

      /**
       * Obter linhas individualmente
       */
      this.context['Linha'] = ebfGetElementFromList.call(this, this.context['Linhas'], this.context['Contador']);

      /**
       * Tabela - Obter Nome da Coluna
       */
      this.context['Nome da Coluna'] = new TabelaObterNomeDaColuna(this, this.getSystem(), this.getForm()).run(this.context['Nome'], ebfXMLGetChildrenElement.call(this, ebfXMLGetRoot.call(this, ebfXMLOpen.call(this, ebfGetClientFormVariable.call(this, ebfConcat.call(this, this.context['Nome'], '_xml_de_propriedades')), null)), null), ebfGetClientFormVariable.call(this, ebfConcat.call(this, this.context['Nome'], '_coluna_chave')));

      /**
       * Obter valor da coluna na linha selecionada
       */
      ebfSetElementAtList.call(this, this.context['Valor'], new TabelaObterValor(this, this.getSystem(), this.getForm()).run(this.context['Nome'], this.context['Linha'], this.context['Nome da Coluna']), null);

      /**
       * Cont++
       */
      this.context['Contador'] = oprAdd.call(this, this.context['Contador'], parseInt(1));
    }

    /**
     * Obter GUID do formulário
     */
    this.context['GUID'] = ebfGetClientFormVariable.call(this, ebfConcat.call(this, this.context['Nome'], '_formulario'));

    /**
     * Tabela - Obter Informação da Consulta
     */
    this.context['Tipo do Campo'] = new TabelaObterInformacaoDaConsulta(this, this.getSystem(), this.getForm()).run(this.context['Nome'], parseInt(4), ebfGetClientFormVariable.call(this, ebfConcat.call(this, this.context['Nome'], '_coluna_chave')));

    /**
     * Geral - Obter Tipo do Campo Cliente
     */
    this.context['Tipo do Campo'] = new GeralObterTipoDoCampoCliente(this, this.getSystem(), this.getForm()).run(this.context['Tipo do Campo'], '');

    /**
     * Tabela - Abrir Formulário - Servidor
     */
    executeSyncJavaRule.call(this, this.getSystem(), this.getForm(), 'Tabela - Abrir Formulário - Servidor', [this.context['GUID'], ebfGetClientFormVariable.call(this, ebfConcat.call(this, this.context['Nome'], '_coluna_chave')), this.context['Valor'], this.context['Tipo do Campo']]);

    /**
     * Fim
     */
    return null;

  }

}

