TabelaInterfaceGerarXml.prototype = new Rule;

/**
 * Esta função executa a regra "Tabela - Interface - Gerar XML"
 * @author Janpier dos Santos
 * @since 26/07/2018 19:39:43
 */
TabelaInterfaceGerarXml.prototype.run = function() {
  document.ruleNameForException = 'Tabela - Interface - Gerar XML';
  this.context = new Array();

  // Variáveis
  this.context['Contador'] = 0;

  this.context['Total de linhas'] = 0;

  this.context['XML'] = '';

  this.context['Aux'] = 0;

  this.context['Alinhamento'] = '';

  this.context['Eventos'] = '';

  this.context['Extras'] = '';

  this.context['Contador'] = parseInt(1);

  /**
   * Obter total de linhas !
   */
  this.context['Total de linhas'] = ebfGridRowCount.call(this, 'MakerGrid1');

  /**
   * Contador é menor ou Igual a 0 ?
   */
  if (parseBoolean(isMinorOrEqual.call(this, this.context['Total de linhas'], parseInt(0)))) {
      
    /**
     * Definir Variável Local result_maker !
     */
    ebfSetLocalVariable.call(this, 'result_maker', '');

    /**
     * Fim
     */
    return null;

  } else {

    /**
     * Iniciar conteúdo XML !
     */
    this.context['XML'] = '<?xml version=\"1.0\" encoding=\"ISO-8859-1\"?><header>';

    /**
     * Contador é menor ou igual ao tamanho da lista ?
     */
    while (parseBoolean(isMinorOrEqual.call(this, this.context['Contador'], this.context['Total de linhas']))) {

      /**
       * Guardar variável Contador - 1
       */
      this.context['Aux'] = toLong.call(this, oprSubtract.call(this, this.context['Contador'], parseInt(1)));

      /**
       * Obter Alinhamento
       */
      this.context['Alinhamento'] = ebfGridGetValue.call(this, 'MakerGrid1', this.context['Aux'], 'Alinhado');

      /**
       * Traduzir Alinhamento
       */
      this.context['Alinhamento'] = (isEqual.call(this, this.context['Alinhamento'], 'Esquerda') ? 'left' : (isEqual.call(this, this.context['Alinhamento'], 'Centro') ? 'center' : 'right'));

      /**
       * Inserir Linha no XML !
       */
      this.context['XML'] = ebfConcat.call(this, this.context['XML'], '<column name =\"', ebfGridGetValue.call(this, 'MakerGrid1', this.context['Aux'], 'Nome'), '\" campo=\"', ebfGridGetValue.call(this, 'MakerGrid1', this.context['Aux'], 'Campo'), '\" width=\"', ebfGridGetValue.call(this, 'MakerGrid1', this.context['Aux'], 'Tamanho'), '\" align=\"', this.context['Alinhamento'], '\" format=\"', ebfGridGetValue.call(this, 'MakerGrid1', this.context['Aux'], 'Formatação'), '\" tipo=\"', ebfGridGetValue.call(this, 'MakerGrid1', this.context['Aux'], 'Tipo'), '\" guid=\"', ebfGridGetValue.call(this, 'MakerGrid1', this.context['Aux'], 'GUID'), '\">');

      /**
       * Tabela - Interface - Gerar XML Evento
       */
      this.context['Eventos'] = new TabelaInterfaceGerarXmlEvento(this, this.getSystem(), this.getForm()).run(ebfGridGetValue.call(this, 'MakerGrid1', this.context['Aux'], 'GUID'));

      /**
       * Acrescenta o evento e fecha a tag da coluna
       */
      this.context['XML'] = ebfConcat.call(this, this.context['XML'], this.context['Eventos']);

      /**
       * Tabela - Interface - Gerar XML Extras
       */
      this.context['Extras'] = new TabelaInterfaceGerarXmlExtras(this, this.getSystem(), this.getForm()).run(ebfGridGetValue.call(this, 'MakerGrid1', this.context['Aux'], 'GUID'));

      /**
       * Acrescenta o evento e fecha a tag da coluna
       */
      this.context['XML'] = ebfConcat.call(this, this.context['XML'], this.context['Extras'], '\n</column>');

      /**
       * Incrementar contador !
       */
      this.context['Contador'] = oprAdd.call(this, this.context['Contador'], parseInt(1));
    }

    /**
     * Finalizar XML !
     */
    this.context['XML'] = ebfConcat.call(this, this.context['XML'], '</header>');

    /**
     * Definir Variável Local result_maker !
     */
    ebfSetLocalVariable.call(this, 'result_maker', executeSyncJavaRule.call(this, this.getSystem(), this.getForm(), 'Tabela - Interface - Codificar Parâmetro', [this.context['XML'], 'S']));

    /**
     * Fim
     */
    return null;

  }

}

