TabelaInterfaceModificarLinha.prototype = new Rule;

/**
 * Esta função executa a regra "Tabela - Interface - Modificar Linha"
 * @param Flag equivale à variável this.context['Flag']<br/>
 * @author masters
 * @since 14/06/2017 10:23:08
 */
TabelaInterfaceModificarLinha.prototype.run = function() {
  document.ruleNameForException = 'Tabela - Interface - Modificar Linha';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Flag'] = this.checkType(arguments[0], 'Inteiro');

  // Variáveis
  this.context['Linha Selecionada'] = 0;

  this.context['Nome'] = '';

  this.context['Campo'] = '';

  this.context['Tamanho'] = '';

  this.context['Alinhado'] = '';

  this.context['Formatação'] = '';

  this.context['Nome Atual'] = '';

  this.context['Campo Atual'] = '';

  this.context['Tamanho Atual'] = '';

  this.context['Alinhado Atual'] = '';

  this.context['Formatação Atual'] = '';

  this.context['Tipo'] = '';

  this.context['GUID'] = '';

  this.context['Tipo Atual'] = '';

  this.context['GUID Atual'] = '';


  /**
   * Obter Linha Selecionada
   */
  this.context['Linha Selecionada'] = ebfGridGetSelectedRow.call(this, 'MakerGrid1');

  /**
   * Linha selecionada igual -1
   */
  if (parseBoolean(isEqual.call(this, toLong.call(this, this.context['Linha Selecionada']), toLong.call(this, parseInt(-1))))) {
      
    /**
     * Mensagem de Alerta
     */
    ActNewWarningMessage(null, 'Selecione uma linha da grade.', parseInt(1), null);

    return this.FlowEnd3();

  } else {

    /**
     * Chegou ao Topo?
     */
    if (parseBoolean((isEqual.call(this, this.context['Linha Selecionada'], parseInt(0)) && isEqual.call(this, this.context['Flag'], parseInt(-1))))) {
        
      return this.FlowEnd3();

    } else {

      /**
       * Chegou ao Fim?
       */
      if (parseBoolean((isEqual.call(this, this.context['Linha Selecionada'], oprSubtract.call(this, ebfGridRowCount.call(this, 'MakerGrid1'), parseFloat(1))) && isEqual.call(this, this.context['Flag'], parseInt(1))))) {
          
        /**
         * Fim
         */
        return null;

      } else {

        /**
         * Grade - Obter Coluna Anterior (NOME)
         */
        this.context['Nome'] = ebfGridGetValue.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']), 'Nome');

        /**
         * Grade - Obter Coluna Anterior (CAMPO)
         */
        this.context['Campo'] = ebfGridGetValue.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']), 'Campo');

        /**
         * Grade - Obter Coluna Anterior (TAMANHO)
         */
        this.context['Tamanho'] = ebfGridGetValue.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']), 'Tamanho');

        /**
         * Grade - Obter Coluna Anterior (ALINHADO)
         */
        this.context['Alinhado'] = ebfGridGetValue.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']), 'Alinhado');

        /**
         * Grade - Obter Coluna Anterior (FORMATAÇÃO)
         */
        this.context['Formatação'] = ebfGridGetValue.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']), 'Formatação');

        /**
         * Grade - Obter Coluna Anterior (Tipo)
         */
        this.context['Tipo'] = ebfGridGetValue.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']), 'Tipo');

        /**
         * Grade - Obter Coluna Anterior (GUID)
         */
        this.context['GUID'] = ebfGridGetValue.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']), 'GUID');

        /**
         * Grade - Obter Coluna (NOME)
         */
        this.context['Nome Atual'] = ebfGridGetValue.call(this, 'MakerGrid1', this.context['Linha Selecionada'], 'Nome');

        /**
         * Grade - Obter Coluna (CAMPO)
         */
        this.context['Campo Atual'] = ebfGridGetValue.call(this, 'MakerGrid1', this.context['Linha Selecionada'], 'Campo');

        /**
         * Grade - Obter Coluna (TAMANHO)
         */
        this.context['Tamanho Atual'] = ebfGridGetValue.call(this, 'MakerGrid1', this.context['Linha Selecionada'], 'Tamanho');

        /**
         * Grade - Obter Coluna (ALINHADO)
         */
        this.context['Alinhado Atual'] = ebfGridGetValue.call(this, 'MakerGrid1', this.context['Linha Selecionada'], 'Alinhado');

        /**
         * Grade - Obter Coluna (FORMATAÇÃO)
         */
        this.context['Formatação Atual'] = ebfGridGetValue.call(this, 'MakerGrid1', this.context['Linha Selecionada'], 'Formatação');

        /**
         * Grade - Obter Coluna (Tipo)
         */
        this.context['Tipo Atual'] = ebfGridGetValue.call(this, 'MakerGrid1', this.context['Linha Selecionada'], 'Tipo');

        /**
         * Grade - Obter Coluna (GUID)
         */
        this.context['GUID Atual'] = ebfGridGetValue.call(this, 'MakerGrid1', this.context['Linha Selecionada'], 'GUID');

        /**
         * Grade - Atribuir Novo Valor (NOME)
         */
        ebfGridSetValue.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']), 'Nome', this.context['Nome Atual']);

        /**
         * Grade - Atribuir Novo Valor (CAMPO)
         */
        ebfGridSetValue.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']), 'Campo', this.context['Campo Atual']);

        /**
         * Grade - Atribuir Novo Valor (TAMANHO)
         */
        ebfGridSetValue.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']), 'Tamanho', this.context['Tamanho Atual']);

        /**
         * Grade - Atribuir Novo Valor (ALINHADO)
         */
        ebfGridSetValue.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']), 'Alinhado', this.context['Alinhado Atual']);

        /**
         * Grade - Atribuir Novo Valor (FORMATAÇÃO)
         */
        ebfGridSetValue.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']), 'Formatação', this.context['Formatação Atual']);

        /**
         * Grade - Atribuir Novo Valor (TIPO)
         */
        ebfGridSetValue.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']), 'Tipo', this.context['Tipo Atual']);

        /**
         * Grade - Atribuir Novo Valor (GUID)
         */
        ebfGridSetValue.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']), 'GUID', this.context['GUID Atual']);

        /**
         * Grade - Atribuir Novo Valor (NOME)
         */
        ebfGridSetValue.call(this, 'MakerGrid1', this.context['Linha Selecionada'], 'Nome', this.context['Nome']);

        /**
         * Grade - Atribuir Novo Valor (CAMPO)
         */
        ebfGridSetValue.call(this, 'MakerGrid1', this.context['Linha Selecionada'], 'Campo', this.context['Campo']);

        /**
         * Grade - Atribuir Novo Valor (TAMANHO)
         */
        ebfGridSetValue.call(this, 'MakerGrid1', this.context['Linha Selecionada'], 'Tamanho', this.context['Tamanho']);

        /**
         * Grade - Atribuir Novo Valor (ALINHADO)
         */
        ebfGridSetValue.call(this, 'MakerGrid1', this.context['Linha Selecionada'], 'Alinhado', this.context['Alinhado']);

        /**
         * Grade - Atribuir Novo Valor (FORMATAÇÃO)
         */
        ebfGridSetValue.call(this, 'MakerGrid1', this.context['Linha Selecionada'], 'Formatação', this.context['Formatação']);

        /**
         * Grade - Atribuir Novo Valor (Tipo)
         */
        ebfGridSetValue.call(this, 'MakerGrid1', this.context['Linha Selecionada'], 'Tipo', this.context['Tipo']);

        /**
         * Grade - Atribuir Novo Valor (GUID)
         */
        ebfGridSetValue.call(this, 'MakerGrid1', this.context['Linha Selecionada'], 'GUID', this.context['GUID']);

        /**
         * Grade - Selecionar Linha
         */
        ebfGridSelectRow.call(this, 'MakerGrid1', oprAdd.call(this, this.context['Linha Selecionada'], this.context['Flag']));

        /**
         * Tabela - Interface - Gerar XML
         */
        new TabelaInterfaceGerarXml(this, this.getSystem(), this.getForm()).run();

        /**
         * Fim
         */
        return null;

      }

    }

  }

}

TabelaInterfaceModificarLinha.prototype.FlowEnd3 = function() {

    /**
     * Fim
     */
    return null;
  }


