TabelaObterCorCondicional.prototype = new Rule;

/**
 * Esta função executa a regra "Tabela - Obter Cor Condicional"
 * @param Cor Condicional equivale à variável this.context['Cor Condicional']<br/>
 * @author Janpier
 * @since 15/02/2022 11:38:48
 */
TabelaObterCorCondicional.prototype.run = function() {
  document.ruleNameForException = 'Tabela - Obter Cor Condicional';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Cor Condicional'] = this.checkType(arguments[0], 'Letras');

  // Variáveis
  this.context['Lista de Condições'] = null;

  this.context['Cores'] = null;

  this.context['Contador'] = 0;

  this.context['Lista Aux'] = null;

  this.context['Lista de Colunas'] = null;

  this.context['Contador Aux'] = 0;

  this.context['Lista'] = null;

  this.context['Contador'] = parseInt(1);
  this.context['Contador Aux'] = parseInt(1);

  /**
   * Quebrar Texto pelo enter
   */
  this.context['Lista'] = ebfSplit.call(this, this.context['Cor Condicional'], ebfCharacter.call(this, parseInt(10)));

  /**
   * Criar Lista de Condições
   */
  this.context['Lista de Condições'] = ebfListCreate.call(this);

  /**
   * Criar Lista de Cores
   */
  this.context['Cores'] = ebfListCreate.call(this);

  /**
   * Criar Lista de Colunas
   */
  this.context['Lista de Colunas'] = ebfListCreate.call(this);

  /**
   * Contador é Menor que Tamanho da Lista
   */
  while (parseBoolean(isMinorOrEqual.call(this, this.context['Contador'], oprSubtract.call(this, ebfListLength.call(this, this.context['Lista']), parseInt(1))))) {

    /**
     * Quebrar Texto por Tabulação
     */
    this.context['Lista Aux'] = ebfSplit.call(this, toString.call(this, ebfGetElementFromList.call(this, this.context['Lista'], this.context['Contador'])), ebfCharacter.call(this, parseInt(9)));

    /**
     * Atualizar Valor do Contador Aux
     */
    this.context['Contador Aux'] = parseInt(1);

    /**
     * Contador Aux é menor ou igual ao Tamanho da Lista Aux?
     */
    while (parseBoolean(isMinorOrEqual.call(this, this.context['Contador Aux'], ebfListLength.call(this, this.context['Lista Aux'])))) {

      /**
       * Resto é igual a 0?
       */
      if (parseBoolean(isEqual.call(this, ebfOprMod.call(this, this.context['Contador Aux'], parseInt(2)), parseInt(0)))) {
          
        /**
         * Inserir Condição na Lista
         */
        ebfSetElementAtList.call(this, this.context['Lista de Colunas'], ebfGetElementFromList.call(this, this.context['Lista Aux'], this.context['Contador Aux']), null);

        var FlowExpression4 = this.FlowExpression4();
        if (!(FlowExpression4 instanceof InvalidVariant)) {
          return FlowExpression4;
        }

      } else {

        /**
         * Inserir Condição na Lista
         */
        ebfSetElementAtList.call(this, this.context['Lista de Condições'], ebfGetElementFromList.call(this, this.context['Lista Aux'], this.context['Contador Aux']), null);

        var FlowExpression4 = this.FlowExpression4();
        if (!(FlowExpression4 instanceof InvalidVariant)) {
          return FlowExpression4;
        }

      }
    }

    /**
     * Cont++
     */
    this.context['Contador'] = oprAdd.call(this, this.context['Contador'], parseInt(1));
  }

  /**
   * Tabela - Obter Cor Condicional - Fluxo Auxiliar
   */
  this.context['Lista'] = new TabelaObterCorCondicionalFluxoAuxiliar(this, this.getSystem(), this.getForm()).run(this.context['Lista de Condições'], this.context['Lista de Colunas']);

  /**
   * Fim
   */
  return this.context['Lista'];

}

TabelaObterCorCondicional.prototype.FlowExpression4 = function() {

    /**
     * Contador Aux++
     */
    this.context['Contador Aux'] = oprAdd.call(this, this.context['Contador Aux'], parseInt(1));

    return new InvalidVariant();
  }


