TabelaObterCorCondicionalFluxoAuxiliar.prototype = new Rule;

/**
 * Esta função executa a regra "Tabela - Obter Cor Condicional - Fluxo Auxiliar"
 * @param Lista de Condições equivale à variável this.context['Lista de Condições']<br/>
 * @param Lista de Colunas equivale à variável this.context['Lista de Colunas']<br/>
 * @author Janpier
 * @since 15/02/2022 11:37:38
 */
TabelaObterCorCondicionalFluxoAuxiliar.prototype.run = function() {
  document.ruleNameForException = 'Tabela - Obter Cor Condicional - Fluxo Auxiliar';
  this.context = new Array();

  // Parâmetros de Entrada
  this.context['Lista de Condições'] = this.checkType(arguments[0], 'Variante');

  this.context['Lista de Colunas'] = this.checkType(arguments[1], 'Variante');

  // Variáveis
  this.context['Contador'] = 0;

  this.context['Condições'] = null;

  this.context['Cores'] = null;

  this.context['Lista Aux'] = null;

  this.context['Contador Aux'] = 0;

  this.context['Lista Aux 2'] = null;

  this.context['Colunas'] = null;

  this.context['Contador'] = parseInt(1);
  this.context['Contador Aux'] = parseInt(1);

  /**
   * Criar Objeto Lista Com Condições
   */
  this.context['Condições'] = ebfListCreate.call(this);

  /**
   * Criar Objeto Lista Com Cores
   */
  this.context['Cores'] = ebfListCreate.call(this);

  /**
   * Criar Objeto Lista Com Colunas
   */
  this.context['Colunas'] = ebfListCreate.call(this);

  /**
   * Contador é Menor ou Igual ao tamanho da lista de condições
   */
  while (parseBoolean(isMinorOrEqual.call(this, this.context['Contador'], ebfListLength.call(this, this.context['Lista de Condições'])))) {

    /**
     * Quebrar Texto por ;
     */
    this.context['Lista Aux'] = ebfSplit.call(this, ebfGetElementFromList.call(this, this.context['Lista de Condições'], this.context['Contador']), ';');

    /**
     * Contador Aux é menor ou igual ao tamanho da lista?
     */
    while (parseBoolean(isMinorOrEqual.call(this, this.context['Contador Aux'], ebfListLength.call(this, this.context['Lista Aux'])))) {

      /**
       * Contador é par?
       */
      if (parseBoolean(isEqual.call(this, ebfOprMod.call(this, this.context['Contador Aux'], parseInt(2)), parseInt(0)))) {
          
        /**
         * Inserir Lista de Condições
         */
        ebfSetElementAtList.call(this, this.context['Cores'], ebfGetElementFromList.call(this, this.context['Lista Aux'], this.context['Contador Aux']), null);

        var FlowRemark1 = this.FlowRemark1();
        if (!(FlowRemark1 instanceof InvalidVariant)) {
          return FlowRemark1;
        }

      } else {

        /**
         * Inserir Lista de Cores
         */
        ebfSetElementAtList.call(this, this.context['Condições'], ebfGetElementFromList.call(this, this.context['Lista Aux'], this.context['Contador Aux']), null);

        var FlowRemark1 = this.FlowRemark1();
        if (!(FlowRemark1 instanceof InvalidVariant)) {
          return FlowRemark1;
        }

      }
    }

    /**
     * Cont Aux igual 1
     */
    this.context['Contador Aux'] = parseInt(1);

    /**
     * Cont++
     */
    this.context['Contador'] = oprAdd.call(this, this.context['Contador'], parseInt(1));
  }

  /**
   * Contador igual a 1
   */
  this.context['Contador'] = parseInt(1);

  /**
   * Contador é menor ou Igual aol tamanho Lista
   */
  while (parseBoolean(isMinorOrEqual.call(this, this.context['Contador'], ebfListLength.call(this, this.context['Lista de Condições'])))) {

    /**
     * Criar Objeto Lista Aux2
     */
    this.context['Lista Aux 2'] = ebfListCreate.call(this);

    /**
     * Inserir Lista de Colunas em outra Lista
     */
    ebfSetElementAtList.call(this, this.context['Colunas'], ebfGetElementFromList.call(this, this.context['Lista de Colunas'], this.context['Contador']), null);

    /**
     * Cont++
     */
    this.context['Contador'] = oprAdd.call(this, this.context['Contador'], parseInt(1));
  }

  /**
   * Fim
   */
  return ebfListParamsCreate.call(this, this.context['Condições'], this.context['Cores'], this.context['Colunas']);

}

TabelaObterCorCondicionalFluxoAuxiliar.prototype.FlowRemark1 = function() {

    /**
     * Cont Aux++
     */
    this.context['Contador Aux'] = oprAdd.call(this, this.context['Contador Aux'], parseInt(1));

    return new InvalidVariant();
  }


